(4, 2, 1, 1, '\r\n<section class=\"section\">\r\n	<div class=\"container container--narrow\">\r\n		<div class=\"row\">\r\n			<div class=\"col-lg-5\">\r\n				<div class=\"primary-content\">\r\n					<div class=\"main__title\">\r\n						<h2>It starts with<br />\r\n							Who We Are.</h2></div></div></div>\r\n			<div class=\"col-lg-7\">\r\n				<div class=\"who-we__content\">\r\n					<p>&nbsp;<span style=\"color: rgb(17, 17, 17); font-size: var(--font-size-h5); font-weight: 600;\">We build a organization to help people to learn online.</span></p>\r\n					<p open=\"\" sans\";=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\" style=\"box-sizing: border-box; outline: 0px; margin-top: 0px; margin-bottom: var(--margin-8); line-height: 36px; color: rgb(17, 17, 17); font-size: var(--font-size-medium);\">Yo!Coach is a self-hosted solution that helps entrepreneurs to launch online tutoring and consultation platforms where multiple tutors or consultants can register and deliver one-to-one or group online sessions to learners. It is a highly scalable and fully customizable solution to meet the business requirements of the users. The solution is pre-integrated with Cometchat, Lesson Space, and Zoom to support features such as video chat, Whiteboard, Textpad, code editor, multiple screen sharing, etc. which improves the interaction between tutor and learner during an online session.</p>\r\n					<p open=\"\" sans\";=\"\" background-color:=\"\" rgb(255,=\"\" 255,=\"\" 255);\"=\"\" style=\"box-sizing: border-box; outline: 0px; margin-top: 0px; margin-bottom: var(--margin-8); line-height: 36px; color: rgb(17, 17, 17); font-size: var(--font-size-medium);\">For seamless payment transactions, Yo!Coach is integrated with secured payment gateways like Paypal, Authorize.net, Stripe, Paystack, PayGate, 2Checkout/2CO. It is a complete solution with robust functionalities and essential features that guarantee high performance and competitive results. In addition to this, Yo!Coach is also available as PWA</p></div></div></div></div></section>\r\n<section class=\"section section--value\">\r\n	<div class=\"container container--narrow\">\r\n		<div class=\"row flex-lg-nowrap\">\r\n			<div class=\"col-lg-5\">\r\n				<div class=\"panel-left\">\r\n					<h6 class=\"small-title\">Our Core Values</h6>\r\n					<h2>We love clients who<br />\r\n						understand our values</h2>\r\n					<div class=\"slider-nav\">\r\n						<button type=\"button\" class=\"prev-slide\" aria-label=\"Previous\"></button>&nbsp;\r\n						<button type=\"button\" class=\"next-slide\" aria-label=\"Next\"></button></div></div></div>\r\n			<div class=\"col-lg-12\">\r\n				<div class=\"panel-right\">\r\n					<div class=\"slider slider--value slider--onehalf slider-onehalf-js\">\r\n						<div>\r\n							<div class=\"slider__item\">\r\n								<div class=\"slide-box\">\r\n									<div class=\"slide-box__head\">\r\n										<div class=\"count__box\">\r\n											<h2>01</h2></div>\r\n										<div class=\"slide-box__title\">\r\n											<h5>Words of Appreciation</h5></div></div>\r\n									<div class=\"slide-box__body\">\r\n										<p>Every solution was taking too much time with nothing less than 6 - 8 months, and it was time we did not have. That\'s when Wale found FATbit\'s Yo!Coach. We explored our vision around what Yo!Coach had to offer, and to our surprise, it fit exactly what we had in mind, and we had a live demo of Yo!Coach. We took the chance of picking up a solution to run our vision on, and we haven\'t regretted it any bit. So far, it\'s been a good one for the team.</p>\r\n										<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n										<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; -Mr. Chin Wei Seong</p>\r\n										<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;WTutors</p></div></div></div></div>\r\n						<div>\r\n							<div class=\"slider__item\">\r\n								<div class=\"slide-box\">\r\n									<div class=\"slide-box__head\">\r\n										<div class=\"count__box\">\r\n											<h2>02</h2></div>\r\n										<div class=\"slide-box__title\">\r\n											<h5>Words of Appreciation</h5></div></div>\r\n									<div class=\"slide-box__body\">\r\n										<p>We are a brick-and-mortar physical location language school franchise. Once the COVID-19 shut down happened we needed to move online. Yo!Coach provides a very modern platform for us to execute not only language learning but all types of learning.</p>\r\n										<p>&nbsp;</p>\r\n										<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;-Ray D Angelo</p>\r\n										<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Portal Teach</p></div></div></div></div>\r\n						<div>\r\n							<div class=\"slider__item\">\r\n								<div class=\"slide-box\">\r\n									<div class=\"slide-box__head\">\r\n										<div class=\"count__box\">\r\n											<h2>03</h2></div>\r\n										<div class=\"slide-box__title\">\r\n											<h5>Words of Appreciation</h5></div></div>\r\n									<div class=\"slide-box__body\">\r\n										<p>My journey with FATbit has been a long one. It took hours and patience to get the website done and to the exact expectations I asked for. FATbit never gives up, they always deliver what they say no matter how much overtime they spend on the project and customer. My developer Eddie, my sales contact Kesa went over and above the call of duty to stay on top of this project. End result; A beautiful and powerfully functional site that will change the worlds way of learning a new language. Thank you FATbit.</p>\r\n										<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n										<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; -Kelly</p>\r\n										<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;WeYakYak</p></div></div></div></div></div></div></div></div></div></section>\r\n<section class=\"section section--mission\">\r\n	<div class=\"container container--narrow\">\r\n		<div class=\"row\">\r\n			<div class=\"col-md-5 col-lg-5\">\r\n				<div class=\"primary-content\">\r\n					<h6 class=\"small-title\">Our mission &amp; Vision</h6>\r\n					<div class=\"main__title\">\r\n						<h2>Get to know about our<br />\r\n							mission and vision</h2></div><a href=\"https://yocoach3.bestech.4qcteam.com/contact\" class=\"btn btn--primary\">Contact Us</a></div></div>\r\n			<div class=\"col-md-7 col-lg-7\">\r\n				<div class=\"mission\">\r\n					<div class=\"mission__head\">\r\n						<div class=\"mission__media\"><img src=\"https://yocoach3.bestech.4qcteam.com/image/editor-image/1650025272-mission.png\" alt=\"Our Mission\" /></div>\r\n						<h4><br />\r\n							</h4>\r\n						<h4>Our Mission</h4></div>\r\n					<div class=\"mission__body\">\r\n						<p>Our mission is to help entrepreneurs and tutors set up their own online tutoring platforms like Verbling, Preply, and Cambly. We help them reach the pinnacle of their career by enabling them to launch their own tutoring platform using our readymade solution.</p></div></div>\r\n				<div class=\"mission\">\r\n					<div class=\"mission__head\">\r\n						<div class=\"mission__media\"><img src=\"https://yocoach3.bestech.4qcteam.com/image/editor-image/1650025364-vision.png\" alt=\"our Inspiration &amp; Vision\" /></div>\r\n						<h4><br />\r\n							</h4>\r\n						<h4>Our Inspiration &amp; Vison</h4></div>\r\n					<div class=\"mission__body\">\r\n						<p>We, being the leaders and industry experts, provide our turnkey edtech solution, to help entrepreneurs to start their tutoring businesses. Our aim is to offer an easy and hassle-free process for them to enter the market and become a pioneer.</p></div></div>\r\n				<div class=\"mission\">\r\n					<div class=\"mission__head\">\r\n						<div class=\"mission__media\"><img src=\"https://yocoach3.bestech.4qcteam.com/image/editor-image/1650025272-mission.png\" alt=\"Our Goal\" /></div>\r\n						<h4>Our Goal</h4></div>\r\n					<div class=\"mission__body\">\r\n						<p>Nam libero tempore, cum soluta nobis est eligendi optio cumque nihil impedit quo minus id quod maxime placeat facere possimus, omnis voluptas assumenda est, omnis dolor repellendus Temporibus autem.</p></div></div></div></div></div></section>\r\n<section class=\"section section--team\">\r\n	<div class=\"container container--narrow\">\r\n		<div class=\"team\">\r\n			<div class=\"team__head\">\r\n				<div class=\"row\">\r\n					<div class=\"col-lg-5\">\r\n						<div class=\"primary-content\">\r\n							<h6 class=\"small-title\">People</h6>\r\n							<div class=\"main__title\">\r\n								<h2>Meet our team<br />\r\n									of experts</h2></div></div></div>\r\n					<div class=\"col-lg-7\">\r\n						<p class=\"team-content\">Our highly knowledgeable and experienced team members have a creative, collaborative, and committed nature which enables Yo!Coach to be a highly effective company.</p></div></div></div>\r\n			<div class=\"team__body\">\r\n				<div class=\"row\">\r\n					<div class=\"col-sm-6 col-lg-4\">\r\n						<div class=\"tile\">\r\n							<div class=\"tile__head\">\r\n								<div class=\"tile__media \"><img src=\"https://yocoach3.bestech.4qcteam.com/image/editor-image/1650349417-ceo364x364.png\" alt=\"Stephen Fleming CEO &amp; Founder\" /></div></div>\r\n							<div class=\"tile__body\">\r\n								<h6>Stephen Fleming</h6>\r\n								<p>CEO &amp; Founder</p></div></div></div>\r\n					<div class=\"col-sm-6 col-lg-4\">\r\n						<div class=\"tile\">\r\n							<div class=\"tile__head\">\r\n								<div class=\"tile__media \"><img src=\"https://yocoach3.bestech.4qcteam.com/image/editor-image/1650349567-marketinghead364x3641.png\" alt=\"Nathan Astle Sales Marketing Head\" /></div></div>\r\n							<div class=\"tile__body\">\r\n								<h6>Nathan Astle</h6>\r\n								<p>Sales/Marketing Head</p></div></div></div>\r\n					<div class=\"col-sm-6 col-lg-4\">\r\n						<div class=\"tile\">\r\n							<div class=\"tile__head\">\r\n								<div class=\"tile__media \"><img src=\"https://yocoach3.bestech.4qcteam.com/image/editor-image/1650349739-creativedirector364x3642.png\" alt=\"James Anderson Creative Director\" /></div></div>\r\n							<div class=\"tile__body\">\r\n								<h6>James Anderson</h6>\r\n								<p>Creative Director</p></div></div></div>\r\n					<div class=\"col-sm-6 col-lg-4\">\r\n						<div class=\"tile\">\r\n							<div class=\"tile__head\">\r\n								<div class=\"tile__media \"><img src=\"https://yocoach3.bestech.4qcteam.com/image/editor-image/1650349751-techlead364x3643.png\" alt=\"Mark Boucher\" /></div></div>\r\n							<div class=\"tile__body\">\r\n								<h6>Mark Boucher</h6>\r\n								<p>Tech Lead</p></div></div></div>\r\n					<div class=\"col-sm-6 col-lg-4\">\r\n						<div class=\"tile\">\r\n							<div class=\"tile__head\">\r\n								<div class=\"tile__media \"><img src=\"https://yocoach3.bestech.4qcteam.com/image/editor-image/1650349756-saleshead364x3644.png\" alt=\"Steve Waugh\" /></div></div>\r\n							<div class=\"tile__body\">\r\n								<h6>Steve Waugh</h6>\r\n								<p>Sales/Marketing Head</p></div></div></div>\r\n					<div class=\"col-sm-6 col-lg-4\">\r\n						<div class=\"tile\">\r\n							<div class=\"tile__head\">\r\n								<div class=\"tile__media \"><img src=\"https://yocoach3.bestech.4qcteam.com/image/editor-image/1650349761-creativedirector2364x3645.png\" alt=\"Damien Martyn\" /></div></div>\r\n							<div class=\"tile__body\">\r\n								<h6>Damien Martyn</h6>\r\n								<p>Creative Director</p></div></div></div></div></div></div></div></section>\r\n<section class=\"section section--step\">\r\n	<div class=\"container container--narrow\">\r\n		<div class=\"section__head\">\r\n			<h2>How to start learning with Yo!Coach?</h2></div>\r\n		<div class=\"section__body\">\r\n			<div class=\"step-wrapper\">\r\n				<div class=\"step-container__head\">\r\n					<div class=\"step-tabs slider-tabs--js\">\r\n						<div>\r\n							<button class=\"slider-tabs__action\"><span class=\"slider-tabs__number\">01.&nbsp;</span><span class=\"slider-tabs__label\">Search</span></button></div>\r\n						<div>\r\n							<button class=\"slider-tabs__action\"><span class=\"slider-tabs__number\">02.&nbsp;</span><span class=\"slider-tabs__label\">Book</span></button></div>\r\n						<div>\r\n							<button class=\"slider-tabs__action\"><span class=\"slider-tabs__number\">03.&nbsp;</span><span class=\"slider-tabs__label\">Learn</span></button></div></div></div>\r\n				<div class=\"step-container__body\">\r\n					<div class=\"step-slider step-slider-js\">\r\n						<div>\r\n							<div class=\"step\">\r\n								<div class=\"row \">\r\n									<div class=\"col-md-6 col-lg-5 col-xl-6\">\r\n										<div class=\"step__inner\">\r\n											<div class=\"step__media\"><img src=\"https://yocoach3.bestech.4qcteam.com/image/editor-image/1650021362-search.png\" alt=\"Search through hundreds of best teachers\" /></div></div></div>\r\n									<div class=\"col-md-6 col-lg-7 col-xl-6\">\r\n										<div class=\"step__content\">\r\n											<h3>&nbsp;</h3>\r\n											<h3>Search through hundreds of best teachers</h3>\r\n											<p>Use filters like price, language, proficiency, subject, location, to search for your preferred teacher</p>\r\n											<div class=\"step__actions\"><a href=\"https://yocoach3.bestech.4qcteam.com/admin/content-pages#\" class=\"btn btn--primary\">Browse Tutors</a>&nbsp;<a data-src=\"https://www.youtube.com/embed/q_Fy8DceWZM?autoplay=1\" class=\"btn-video play-video\">&nbsp;\r\n													<svg class=\"icon icon--play\">\r\n														<use xlink:href=\"images/sprite.yo-coach.svg#play\"></use></svg>&nbsp;Watch Video</a></div></div></div></div></div></div>\r\n						<div>\r\n							<div class=\"step\">\r\n								<div class=\"row \">\r\n									<div class=\"col-md-6 col-lg-5 col-xl-6\">\r\n										<div class=\"step__inner\">\r\n											<div class=\"step__media\"><img src=\"https://yocoach3.bestech.4qcteam.com/image/editor-image/1650021522-Book.png\" alt=\"Book lessons with the best teacher for you\" /></div></div></div>\r\n									<div class=\"col-md-6 col-lg-7 col-xl-6\">\r\n										<div class=\"step__content\">\r\n											<h3>&nbsp;</h3>\r\n											<h3>Book lessons with the best teacher for you</h3>\r\n											<p>Go through the teachers profile and book a lesson after making the payment.</p>\r\n											<div class=\"step__actions\"><a href=\"https://yocoach3.bestech.4qcteam.com/admin/content-pages#\" class=\"btn btn--primary\">Browse Tutors</a>&nbsp;<a href=\"https://yocoach3.bestech.4qcteam.com/admin/content-pages#\" class=\"btn-video\">\r\n													<svg class=\"icon icon--play\">\r\n														<use xlink:href=\"images/sprite.yo-coach.svg#play\"></use></svg>&nbsp;Watch Video</a></div></div></div></div></div></div>\r\n						<div>\r\n							<div class=\"step\">\r\n								<div class=\"row \">\r\n									<div class=\"col-md-6 col-lg-5 col-xl-6\">\r\n										<div class=\"step__inner\">\r\n											<div class=\"step__media\"><img src=\"https://yocoach3.bestech.4qcteam.com/image/editor-image/1650021648-learn.png\" alt=\"Log in to Rtist and Start learning\" /></div></div></div>\r\n									<div class=\"col-md-6 col-lg-7 col-xl-6\">\r\n										<div class=\"step__content\">\r\n											<h3>&nbsp;</h3>\r\n											<h3>Log in to Start learning</h3>\r\n											<p>Attend online lessons and start learning.</p>\r\n											<div class=\"step__actions\"><a href=\"https://yocoach3.bestech.4qcteam.com/admin/content-pages#\" class=\"btn btn--primary\">Browse Tutors</a>&nbsp;<a href=\"https://yocoach3.bestech.4qcteam.com/admin/content-pages#\" class=\"btn-video\">\r\n													<svg class=\"icon icon--play\">\r\n														<use xlink:href=\"images/sprite.yo-coach.svg#play\"></use></svg>&nbsp;Watch Video</a></div>\r\n											<div class=\"step__actions\"><br />\r\n												</div></div></div></div></div></div></div></div></div></div></div></section>\r\n<section class=\"section section--achievement\">\r\n	<div class=\"container container--narrow\">\r\n		<div class=\"row\">\r\n			<div class=\"col-md-4\">\r\n				<div class=\"box\">\r\n					<div class=\"box__head\">\r\n						<div class=\"achievement-media\"><img src=\"https://yocoach3.bestech.4qcteam.com/image/editor-image/1650351210-translater.png\" alt=\"Image\" /></div></div>\r\n					<div class=\"box__body\">\r\n						<h3 class=\"achievement-title\">130 +</h3>\r\n						<p>Languages Available to Learn</p></div></div></div>\r\n			<div class=\"col-md-4\">\r\n				<div class=\"box\">\r\n					<div class=\"box__head\">\r\n						<div class=\"achievement-media\"><img src=\"https://yocoach3.bestech.4qcteam.com/image/editor-image/1650351215-teacher.png\" alt=\"Image\" /></div></div>\r\n					<div class=\"box__body\">\r\n						<h3 class=\"achievement-title\">10,000+</h3>\r\n						<p>Teachers From 120 Countries</p></div></div></div>\r\n			<div class=\"col-md-4\">\r\n				<div class=\"box\">\r\n					<div class=\"box__head\">\r\n						<div class=\"achievement-media\"><img src=\"https://yocoach3.bestech.4qcteam.com/image/editor-image/1650351220-learner.png\" alt=\"Image\" /></div></div>\r\n					<div class=\"box__body\">\r\n						<h3 class=\"achievement-title\">5,000,000+</h3>\r\n						<p>Learners From 180 Countries</p></div></div></div></div></div></section>'),
(5, 2, 1, 2, '\r\n');
INSERT INTO `tbl_content_pages_lang` (`cpagelang_cpage_id`, `cpagelang_lang_id`, `cpage_title`, `cpage_content`, `cpage_image_title`, `cpage_image_content`) VALUES
(1, 1, 'About Us', '<section class=\"section\">\r\n	<div class=\"container container--narrow\">\r\n		<div class=\"row\">\r\n			<div class=\"col-lg-5\">\r\n				<div class=\"primary-content\">\r\n					<div class=\"main__title\">\r\n						<h2>It starts with<br />\r\n							Who We Are.</h2></div></div></div>\r\n			<div class=\"col-lg-7\">\r\n				<div class=\"who-we__content\">\r\n					<p>We build a organization to help people to learn online.</p>\r\n					<p>Yo!Coach is a self-hosted solution that helps entrepreneurs to launch online tutoring and consultation platforms where multiple tutors or consultants can register and deliver one-to-one or group online sessions to learners. It is a highly scalable and fully customizable solution to meet the business requirements of the users. The solution is pre-integrated with Cometchat, Lesson Space, and Zoom to support features such as video chat, Whiteboard, Textpad, code editor, multiple screen sharing, etc. which improves the interaction between tutor and learner during an online session.</p>\r\n					<p>For seamless payment transactions, Yo!Coach is integrated with secured payment gateways like Paypal, Authorize.net, Stripe, Paystack, PayGate, 2Checkout/2CO. It is a complete solution with robust functionalities and essential features that guarantee high performance and competitive results. In addition to this, Yo!Coach is also available as PWA.</p></div></div></div></div></section>\r\n<section class=\"section section--value\">\r\n	<div class=\"container container--narrow\">\r\n		<div class=\"row flex-lg-nowrap\">\r\n			<div class=\"col-lg-5\">\r\n				<div class=\"panel-left\">\r\n					<h6 class=\"small-title\">Our Core Values</h6>\r\n					<h2>We love clients who<br />\r\n						understand our values</h2>\r\n					<div class=\"slider-nav\">\r\n						<button type=\"button\" class=\"prev-slide\" aria-label=\"Previous\"></button>&nbsp;\r\n						<button type=\"button\" class=\"next-slide\" aria-label=\"Next\"></button></div></div></div>\r\n			<div class=\"col-lg-12\">\r\n				<div class=\"panel-right\">\r\n					<div class=\"slider slider--value slider--onehalf slider-onehalf-js\">\r\n						<div>\r\n							<div class=\"slider__item\">\r\n								<div class=\"slide-box\">\r\n									<div class=\"slide-box__head\">\r\n										<div class=\"count__box\">\r\n											<h2>01</h2></div>\r\n										<div class=\"slide-box__title\">\r\n											<h5>Words of Appreciation</h5></div></div>\r\n									<div class=\"slide-box__body\">\r\n										<p>Every solution was taking too much time with nothing less than 6 - 8 months, and it was time we did not have. That\'s when Wale found FATbit\'s Yo!Coach. We explored our vision around what Yo!Coach had to offer, and to our surprise, it fit exactly what we had in mind, and we had a live demo of Yo!Coach. We took the chance of picking up a solution to run our vision on, and we haven\'t regretted it any bit. So far, it\'s been a good one for the team.</p>\r\n										<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n										<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; -Mr. Chin Wei Seong</p>\r\n										<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;WTutors</p></div></div></div></div>\r\n						<div>\r\n							<div class=\"slider__item\">\r\n								<div class=\"slide-box\">\r\n									<div class=\"slide-box__head\">\r\n										<div class=\"count__box\">\r\n											<h2>02</h2></div>\r\n										<div class=\"slide-box__title\">\r\n											<h5>Words of Appreciation</h5></div></div>\r\n									<div class=\"slide-box__body\">\r\n										<p>We are a brick-and-mortar physical location language school franchise. Once the COVID-19 shut down happened we needed to move online. Yo!Coach provides a very modern platform for us to execute not only language learning but all types of learning.</p>\r\n										<p>&nbsp;</p>\r\n										<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;-Ray D Angelo</p>\r\n										<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Portal Teach</p></div></div></div></div>\r\n						<div>\r\n							<div class=\"slider__item\">\r\n								<div class=\"slide-box\">\r\n									<div class=\"slide-box__head\">\r\n										<div class=\"count__box\">\r\n											<h2>03</h2></div>\r\n										<div class=\"slide-box__title\">\r\n											<h5>Words of Appreciation</h5></div></div>\r\n									<div class=\"slide-box__body\">\r\n										<p>My journey with FATbit has been a long one. It took hours and patience to get the website done and to the exact expectations I asked for. FATbit never gives up, they always deliver what they say no matter how much overtime they spend on the project and customer. My developer Eddie, my sales contact Kesa went over and above the call of duty to stay on top of this project. End result; A beautiful and powerfully functional site that will change the worlds way of learning a new language. Thank you FATbit.</p>\r\n										<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n										<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; -Kelly</p>\r\n										<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;WeYakYak</p></div></div></div></div></div></div></div></div></div></section>\r\n<section class=\"section section--mission\">\r\n	<div class=\"container container--narrow\">\r\n		<div class=\"row\">\r\n			<div class=\"col-md-5 col-lg-5\">\r\n				<div class=\"primary-content\">\r\n					<h6 class=\"small-title\">Our mission &amp; Vision</h6>\r\n					<div class=\"main__title\">\r\n						<h2>Get to know about our<br />\r\n							mission and vision</h2></div><a href=\"https://teach.yo-coach.com/contact\" class=\"btn btn--primary\">Contact Us</a>&nbsp;</div>\r\n				<div class=\"primary-content\">&nbsp;</div>\r\n				<div class=\"primary-content\"><br />\r\n					</div>\r\n				<div class=\"primary-content\">&nbsp;</div>\r\n				<div class=\"primary-content\">&nbsp; &nbsp; &nbsp; &nbsp;</div></div>\r\n			<div class=\"col-md-7 col-lg-7\">\r\n				<div class=\"mission\">\r\n					<div class=\"mission__head\"><img src=\"/image/editor-image/1644304476-target2x.png\" alt=\"\" style=\"float: none; margin: 0px; width: 72px; height: 72px;\" />\r\n						<h4>&nbsp;</h4>\r\n						<h4>&nbsp;</h4>\r\n						<h4>&nbsp;</h4>\r\n						<h4>&nbsp;</h4>\r\n						<h4>Our Mission</h4></div>\r\n					<div class=\"mission__body\">\r\n						<p>Our mission is to help entrepreneurs and tutors set up their own online tutoring platforms like Verbling, Preply, and Cambly. We help them reach the pinnacle of their career by enabling them to launch their own tutoring platform using our readymade solution.</p></div></div>\r\n				<div class=\"mission\">\r\n					<div class=\"mission__head\">\r\n						<div class=\"mission__media\"><img src=\"/image/editor-image/1644383230-focus.png\" alt=\"\" style=\"float: none; margin: 0px; width: 72px; height: 72px;\" /></div>\r\n						<h4>Our Vision</h4></div>\r\n					<div class=\"mission__body\">\r\n						<p>We, being the leaders and industry experts, provide our turnkey edtech solution, to help entrepreneurs to start their tutoring businesses. Our aim is to offer an easy and hassle-free process for them to enter the market and become a pioneer.</p></div></div></div></div></div></section>\r\n<section class=\"section section--team\">\r\n	<div class=\"container container--narrow\">\r\n		<div class=\"team\">\r\n			<div class=\"team__head\">\r\n				<div class=\"row\">\r\n					<div class=\"col-lg-5\">\r\n						<div class=\"primary-content\">\r\n							<h6 class=\"small-title\">People</h6>\r\n							<div class=\"main__title\">\r\n								<h2>Meet our team<br />\r\n									of experts</h2></div></div></div>\r\n					<div class=\"col-lg-7\">\r\n						<p class=\"team-content\">Our highly knowledgeable and experienced team members have a creative, collaborative, and committed nature which enables Yo!Coach to be a highly effective company.</p></div></div></div>\r\n			<div class=\"team__body\">\r\n				<div class=\"row\">\r\n					<div class=\"col-sm-6 col-lg-4\">\r\n						<div class=\"tile\">\r\n							<div class=\"tile__head\">\r\n								<div class=\"tile__media \"><img src=\"https://teach.yo-coach.com/images/364x364.png\" alt=\"\" /></div></div>\r\n							<div class=\"tile__body\">\r\n								<h6>Stephen Fleming</h6>\r\n								<p>CEO &amp; Founder</p></div></div></div>\r\n					<div class=\"col-sm-6 col-lg-4\">\r\n						<div class=\"tile\">\r\n							<div class=\"tile__head\">\r\n								<div class=\"tile__media \"><img src=\"https://teach.yo-coach.com/images/364x364_1.png\" alt=\"\" /></div></div>\r\n							<div class=\"tile__body\">\r\n								<h6>Nathan Astle</h6>\r\n								<p>Sales/Marketing Head</p></div></div></div>\r\n					<div class=\"col-sm-6 col-lg-4\">\r\n						<div class=\"tile\">\r\n							<div class=\"tile__head\">\r\n								<div class=\"tile__media \"><img src=\"https://teach.yo-coach.com/images/364x364_2.png\" alt=\"\" /></div></div>\r\n							<div class=\"tile__body\">\r\n								<h6>James Anderson</h6>\r\n								<p>Creative Director</p></div></div></div>\r\n					<div class=\"col-sm-6 col-lg-4\">\r\n						<div class=\"tile\">\r\n							<div class=\"tile__head\">\r\n								<div class=\"tile__media \"><img src=\"https://teach.yo-coach.com/images/364x364_3.png\" alt=\"\" /></div></div>\r\n							<div class=\"tile__body\">\r\n								<h6>Mark Boucher</h6>\r\n								<p>Tech Lead</p></div></div></div>\r\n					<div class=\"col-sm-6 col-lg-4\">\r\n						<div class=\"tile\">\r\n							<div class=\"tile__head\">\r\n								<div class=\"tile__media \"><img src=\"https://teach.yo-coach.com/images/364x364_4.png\" alt=\"\" /></div></div>\r\n							<div class=\"tile__body\">\r\n								<h6>Steve Waugh</h6>\r\n								<p>Sales/Marketing Head</p></div></div></div>\r\n					<div class=\"col-sm-6 col-lg-4\">\r\n						<div class=\"tile\">\r\n							<div class=\"tile__head\">\r\n								<div class=\"tile__media \"><img src=\"https://teach.yo-coach.com/images/364x364_5.png\" alt=\"\" /></div></div>\r\n							<div class=\"tile__body\">\r\n								<h6>Damien Martyn</h6>\r\n								<p>Creative Director</p></div></div></div></div></div></div></div></section>\r\n<section class=\"section section--step\">    \r\n	<div class=\"container con