le__body\">\r\n								<h6>Stephen Fleming</h6>\r\n								<p>CEO &amp; Founder</p></div></div></div>\r\n					<div class=\"col-sm-6 col-lg-4\">\r\n						<div class=\"tile\">\r\n							<div class=\"tile__head\">\r\n								<div class=\"tile__media \"><img src=\"https://teach.yo-coach.com/images/364x364_1.png\" alt=\"\" /></div></div>\r\n							<div class=\"tile__body\">\r\n								<h6>Nathan Astle</h6>\r\n								<p>Sales/Marketing Head</p></div></div></div>\r\n					<div class=\"col-sm-6 col-lg-4\">\r\n						<div class=\"tile\">\r\n							<div class=\"tile__head\">\r\n								<div class=\"tile__media \"><img src=\"https://teach.yo-coach.com/images/364x364_2.png\" alt=\"\" /></div></div>\r\n							<div class=\"tile__body\">\r\n								<h6>James Anderson</h6>\r\n								<p>Creative Director</p></div></div></div>\r\n					<div class=\"col-sm-6 col-lg-4\">\r\n						<div class=\"tile\">\r\n							<div class=\"tile__head\">\r\n								<div class=\"tile__media \"><img src=\"https://teach.yo-coach.com/images/364x364_3.png\" alt=\"\" /></div></div>\r\n							<div class=\"tile__body\">\r\n								<h6>Mark Boucher</h6>\r\n								<p>Tech Lead</p></div></div></div>\r\n					<div class=\"col-sm-6 col-lg-4\">\r\n						<div class=\"tile\">\r\n							<div class=\"tile__head\">\r\n								<div class=\"tile__media \"><img src=\"https://teach.yo-coach.com/images/364x364_4.png\" alt=\"\" /></div></div>\r\n							<div class=\"tile__body\">\r\n								<h6>Steve Waugh</h6>\r\n								<p>Sales/Marketing Head</p></div></div></div>\r\n					<div class=\"col-sm-6 col-lg-4\">\r\n						<div class=\"tile\">\r\n							<div class=\"tile__head\">\r\n								<div class=\"tile__media \"><img src=\"https://teach.yo-coach.com/images/364x364_5.png\" alt=\"\" /></div></div>\r\n							<div class=\"tile__body\">\r\n								<h6>Damien Martyn</h6>\r\n								<p>Creative Director</p></div></div></div></div></div></div></div></section>\r\n<section class=\"section section--step\">    \r\n	<div class=\"container container--narrow\">        \r\n		<div class=\"section__head\">            \r\n			<h2>How to start learning with Yo!Coach?</h2>        </div>        \r\n		<div class=\"section__body\">            \r\n			<div class=\"step-wrapper\">                \r\n				<div class=\"step-container__head\">                    \r\n					<div class=\"step-tabs slider-tabs--js\">                        \r\n						<div>                            \r\n							<button class=\"slider-tabs__action\"><span class=\"slider-tabs__number\">01.&nbsp;</span><span class=\"slider-tabs__label\">Search</span></button>                        </div>                        \r\n						<div>                            \r\n							<button class=\"slider-tabs__action\"><span class=\"slider-tabs__number\">02.&nbsp;</span><span class=\"slider-tabs__label\">Book</span></button>                        </div>                        \r\n						<div>                            \r\n							<button class=\"slider-tabs__action\"><span class=\"slider-tabs__number\">03.&nbsp;</span><span class=\"slider-tabs__label\">Learn</span></button>                        </div>                    </div>                </div>                \r\n				<div class=\"step-container__body\">                    \r\n					<div class=\"step-slider step-slider-js\">                        \r\n						<div>                            \r\n							<div class=\"step\">                                \r\n								<div class=\"row \">                                    \r\n									<div class=\"col-md-6 col-lg-5 col-xl-6\">                                        \r\n										<div class=\"step__inner\">                                            \r\n											<div class=\"step__media\"><img src=\"https://teach.yo-coach.com/images/step-1.png\" alt=\"\" /></div>                                        </div>                                    </div>                                    \r\n									<div class=\"col-md-6 col-lg-7 col-xl-6\">                                        \r\n										<div class=\"step__content\">                                            \r\n											<h3>Search through hundreds of best teachers</h3>                                            \r\n											<p>Use filters like price, language, proficiency, subject, location, to\r\n                                                search for your preferred teacher.</p>                                            \r\n											<div class=\"step__actions\"><a href=\"https://teach.yo-coach.com/admin/content-pages#\" class=\"btn btn--primary\">Browse Tutors</a>&nbsp;<a href=\"javascript:void(0)\" data-src=\"https://www.youtube.com/embed/q_Fy8DceWZM?autoplay=1\" class=\"btn-video play-video\">                                                    \r\n													<svg class=\"icon icon--play\">                                                        \r\n														<use xlink:href=\"images/sprite.yo-coach.svg#play\"></use>                                                    </svg>&nbsp;Watch Video</a></div>                                        </div>                                    </div>                                </div>                            </div>                        </div>                        \r\n						<div>                            \r\n							<div class=\"step\">                                \r\n								<div class=\"row \">                                    \r\n									<div class=\"col-md-6 col-lg-5 col-xl-6\">                                        \r\n										<div class=\"step__inner\">                                            \r\n											<div class=\"step__media\"><img src=\"https://teach.yo-coach.com/images/step-2.png\" alt=\"\" /></div>                                        </div>                                    </div>                                    \r\n									<div class=\"col-md-6 col-lg-7 col-xl-6\">                                        \r\n										<div class=\"step__content\">                                            \r\n											<h3>Book lessons with the best teacher for you</h3>                                            \r\n											<p>Go through the teachers profile and book a lesson after making the\r\n                                                payment.</p>                                            \r\n											<div class=\"step__actions\"><a href=\"https://teach.yo-coach.com/admin/content-pages#\" class=\"btn btn--primary\">Browse Tutors</a>&nbsp;<a href=\"javascript:void(0)\" data-src=\"https://www.youtube.com/embed/q_Fy8DceWZM?autoplay=1\" class=\"btn-video play-video\">                                                    \r\n													<svg class=\"icon icon--play\">                                                        \r\n														<use xlink:href=\"images/sprite.yo-coach.svg#play\"></use>                                                    </svg>&nbsp;Watch Video</a></div>                                        </div>                                    </div>                                </div>                            </div>                        </div>                        \r\n						<div>                            \r\n							<div class=\"step\">                                \r\n								<div class=\"row \">                                    \r\n									<div class=\"col-md-6 col-lg-5 col-xl-6\">                                        \r\n										<div class=\"step__inner\">                                            \r\n											<div class=\"step__media\"><img src=\"https://teach.yo-coach.com/images/step-3.png\" alt=\"\" /></div>                                        </div>                                    </div>                                    \r\n									<div class=\"col-md-6 col-lg-7 col-xl-6\">                                        \r\n										<div class=\"step__content\">                                            \r\n											<h3>Log in to start learning.</h3>                                            \r\n											<p>Attend online lessons and start learning.</p>                                            \r\n											<div class=\"step__actions\"><a href=\"https://teach.yo-coach.com/admin/content-pages#\" class=\"btn btn--primary\">Browse Tutors</a>&nbsp;<a href=\"javascript:void(0)\" data-src=\"https://www.youtube.com/embed/q_Fy8DceWZM?autoplay=1\" class=\"btn-video play-video\">                                                    \r\n													<svg class=\"icon icon--play\">                                                        \r\n														<use xlink:href=\"images/sprite.yo-coach.svg#play\"></use>                                                    </svg>&nbsp;Watch Video</a></div>                                        </div>                                    </div>                                </div>                            </div>                        </div>                    </div>                </div>            </div>        </div>    </div></section>\r\n<section class=\"section section--achievement\">\r\n	<div class=\"container container--narrow\">\r\n		<div class=\"row\">\r\n			<div class=\"col-md-4\">\r\n				<div class=\"box\">\r\n					<div class=\"box__head\">\r\n						<div class=\"achievement-media\"><img src=\"https://teach.yo-coach.com/images/translater.png\" alt=\"\" /></div></div>\r\n					<div class=\"box__body\">\r\n						<h3 class=\"achievement-title\">130 +</h3>\r\n						<p>Languages Available to Learn</p></div></div></div>\r\n			<div class=\"col-md-4\">\r\n				<div class=\"box\">\r\n					<div class=\"box__head\">\r\n						<div class=\"achievement-media\"><img src=\"https://teach.yo-coach.com/images/teacher.png\" alt=\"\" /></div></div>\r\n					<div class=\"box__body\">\r\n						<h3 class=\"achievement-title\">10,000+</h3>\r\n						<p>Teachers From 120 Countries</p></div></div></div>\r\n			<div class=\"col-md-4\">\r\n				<div class=\"box\">\r\n					<div class=\"box__head\">\r\n						<div class=\"achievement-media\"><img src=\"https://teach.yo-coach.com/images/learner.png\" alt=\"\" /></div></div>\r\n					<div class=\"box__body\">\r\n						<h3 class=\"achievement-title\">5,000,000+</h3>\r\n						<p>Learners From 180 Countries</p></div></div></div></div></div></section>', 'We build an organization to help people to learn online.', '');
INSERT INTO `tbl_content_pages_lang` (`cpagelang_cpage_id`, `cpagelang_lang_id`, `cpage_title`, `cpage_content`, `cpage_image_title`, `cpage_image_content`) VALUES
(2, 1, 'Terms & Conditions', '<div class=\"container__cms\">    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\"><span style=\"font-weight: bold;\">Agreement between\r\n                User and https://www.yo-coach.com</span>            \r\n			<o:p></o:p>        </span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">Welcome to Yo!Coach. This website is comprised of various\r\n        web pages operated by FATbit.\r\n        https://www.yo-coach.com is offered to you conditioned on your acceptance\r\n        without modification of the terms, conditions, and notices contained herein\r\n        (the \"Terms\"). Your use of https://www.yo-coach.com constitutes your\r\n        agreement to all such Terms. Please read these terms carefully, and keep a copy\r\n        of them for your reference.\r\n            \r\n			<o:p></o:p></span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">&nbsp;\r\n            \r\n			<o:p></o:p></span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">https://www.yo-coach.com is learning based website..\r\n            \r\n			<o:p></o:p></span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">&nbsp;\r\n            \r\n			<o:p></o:p></span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">Yo!Coach is a teaching platform for teachers and students to\r\n            connect for learning a foreign language. Teachers set their own rates and\r\n            schedules and students pay for classes within the site, pick a teacher. Teacher\r\n            gets paid weekly for each class completion. Yo!Coach pays out 85% of cost to\r\n            teachers and keeps 15% to keep the site in operation.\r\n            \r\n			<o:p></o:p></span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">&nbsp;\r\n            \r\n			<o:p></o:p></span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\"><span style=\"font-weight: bold;\">Electronic\r\n                Communications</span>            \r\n			<o:p></o:p>        </span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">Visiting https://www.yo-coach.com or sending emails to\r\n            Yo!Coach constitutes electronic communications. You consent to receive\r\n            electronic communications and you agree that all agreements, notices,\r\n            disclosures and other communications that we provide to you electronically, via\r\n            email and on the Site, satisfy any legal requirement that such communications\r\n            be in writing.\r\n            \r\n			<o:p></o:p></span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">&nbsp;\r\n            \r\n			<o:p></o:p></span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\"><span style=\"font-weight: bold;\">Your Account</span>            \r\n			<o:p></o:p>        </span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">If you use this site, you are responsible for maintaining\r\n            the confidentiality of your account and password and for restricting access to\r\n            your computer, and you agree to accept responsibility for all activities that\r\n            occur under your account or password. You may not assign or otherwise transfer\r\n            your account to any other person or entity. You acknowledge that Yo!Coach is\r\n            not responsible for third party access to your account that results from theft\r\n            or misappropriation of your account. Yo!Coach and its associates reserve the\r\n            right to refuse or cancel service, terminate accounts, or remove or edit\r\n            content in our sole discretion.\r\n            \r\n			<o:p></o:p></span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">&nbsp;\r\n            \r\n			<o:p></o:p></span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\"><span style=\"font-weight: bold;\">Children Under\r\n                Thirteen</span>            \r\n			<o:p></o:p>        </span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">Yo!Coach does not knowingly collect, either online or\r\n            offline, personal information from persons under the age of thirteen. If you\r\n            are under 18, you may use https://www.yo-coach.com only with permission of a\r\n            parent or guardian.\r\n            \r\n			<o:p></o:p></span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">&nbsp;\r\n            \r\n			<o:p></o:p></span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\"><span style=\"font-weight: bold;\">Cancellation/Refund\r\n                Policy</span>            \r\n			<o:p></o:p>        </span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">You may cancel your class purchases at any time.\r\n            Cancelations made after 30 days will receive a 50% refund. All classes\r\n            purchased will stay in your Yo!Coach account for 6 months. After 6 months your\r\n            classes will expire with no refund. Classes may be used with any teacher of\r\n            your choice. You may also cancel your teachers lessons and re-use your purchase\r\n            within the site with another teacher. For questions please contact\r\n            info@Yo!Coach.com\r\n            \r\n			<o:p></o:p></span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">&nbsp;\r\n            \r\n			<o:p></o:p></span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\"><span style=\"font-weight: bold;\">Links to Third Party\r\n                Sites/Third Party Services</span>            \r\n			<o:p></o:p>        </span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">https://www.yo-coach.com may contain links to other websites\r\n            (\"Linked Sites\"). The Linked Sites are not under the control of\r\n            Yo!Coach and Yo!Coach is not 