(2, 2, 'Terms & Conditions', '<div class=\"container__cms\">    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\"><span style=\"font-weight: bold;\">Agreement between\r\n                User and https://www.yo-coach.com</span>            \r\n			<o:p></o:p>        </span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">Welcome to Yo!Coach. This website is comprised of various\r\n        web pages operated by FATbit.\r\n        https://www.yo-coach.com is offered to you conditioned on your acceptance\r\n        without modification of the terms, conditions, and notices contained herein\r\n        (the \"Terms\"). Your use of https://www.yo-coach.com constitutes your\r\n        agreement to all such Terms. Please read these terms carefully, and keep a copy\r\n        of them for your reference.\r\n            \r\n			<o:p></o:p></span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">&nbsp;\r\n            \r\n			<o:p></o:p></span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">https://www.yo-coach.com is learning based website..\r\n            \r\n			<o:p></o:p></span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">&nbsp;\r\n            \r\n			<o:p></o:p></span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">Yo!Coach is a teaching platform for teachers and students to\r\n            connect for learning a foreign language. Teachers set their own rates and\r\n            schedules and students pay for classes within the site, pick a teacher. Teacher\r\n            gets paid weekly for each class completion. Yo!Coach pays out 85% of cost to\r\n            teachers and keeps 15% to keep the site in operation.\r\n            \r\n			<o:p></o:p></span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">&nbsp;\r\n            \r\n			<o:p></o:p></span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\"><span style=\"font-weight: bold;\">Electronic\r\n                Communications</span>            \r\n			<o:p></o:p>        </span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">Visiting https://www.yo-coach.com or sending emails to\r\n            Yo!Coach constitutes electronic communications. You consent to receive\r\n            electronic communications and you agree that all agreements, notices,\r\n            disclosures and other communications that we provide to you electronically, via\r\n            email and on the Site, satisfy any legal requirement that such communications\r\n            be in writing.\r\n            \r\n			<o:p></o:p></span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">&nbsp;\r\n            \r\n			<o:p></o:p></span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\"><span style=\"font-weight: bold;\">Your Account</span>            \r\n			<o:p></o:p>        </span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">If you use this site, you are responsible for maintaining\r\n            the confidentiality of your account and password and for restricting access to\r\n            your computer, and you agree to accept responsibility for all activities that\r\n            occur under your account or password. You may not assign or otherwise transfer\r\n            your account to any other person or entity. You acknowledge that Yo!Coach is\r\n            not responsible for third party access to your account that results from theft\r\n            or misappropriation of your account. Yo!Coach and its associates reserve the\r\n            right to refuse or cancel service, terminate accounts, or remove or edit\r\n            content in our sole discretion.\r\n            \r\n			<o:p></o:p></span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">&nbsp;\r\n            \r\n			<o:p></o:p></span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\"><span style=\"font-weight: bold;\">Children Under\r\n                Thirteen</span>            \r\n			<o:p></o:p>        </span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">Yo!Coach does not knowingly collect, either online or\r\n            offline, personal information from persons under the age of thirteen. If you\r\n            are under 18, you may use https://www.yo-coach.com only with permission of a\r\n            parent or guardian.\r\n            \r\n			<o:p></o:p></span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">&nbsp;\r\n            \r\n			<o:p></o:p></span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\"><span style=\"font-weight: bold;\">Cancellation/Refund\r\n                Policy</span>            \r\n			<o:p></o:p>        </span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">You may cancel your class purchases at any time.\r\n            Cancelations made after 30 days will receive a 50% refund. All classes\r\n            purchased will stay in your Yo!Coach account for 6 months. After 6 months your\r\n            classes will expire with no refund. Classes may be used with any teacher of\r\n            your choice. You may also cancel your teachers lessons and re-use your purchase\r\n            within the site with another teacher. For questions please contact\r\n            info@Yo!Coach.com\r\n            \r\n			<o:p></o:p></span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">&nbsp;\r\n            \r\n			<o:p></o:p></span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\"><span style=\"font-weight: bold;\">Links to Third Party\r\n                Sites/Third Party Services</span>            \r\n			<o:p></o:p>        </span></p>    \r\n	<p class=\"MsoNormal\"><span open=\"\" sans\";\"=\"\">https://www.yo-coach.com may contain links to other websites\r\n            (\"Linked Sites\"). The Linked Sites are not under the control of\r\n            Yo!Coach and Yo!Coach is not 