INSERT INTO `tbl_content_pages_lang` (`cpagelang_cpage_id`, `cpagelang_lang_id`, `cpage_title`, `cpage_content`, `cpage_image_title`, `cpage_image_content`) VALUES
(3, 1, 'Privacy Policy', '<section class=\"section section--page\">    \r\n	<div class=\"container container--narrow\">        \r\n		<div class=\"section__body\">            \r\n			<div class=\"box\">                \r\n				<div class=\"cms-container\">                    \r\n					<p class=\"MsoNormal\">Protecting your private information is our priority. This\r\n                        Statement of Privacy applies to http://www.yo-coach.com and Yo!Coach and\r\n                        governs data collection and usage. For the purposes of this Privacy Policy,\r\n                        unless otherwise noted, all references to Yo!Coach include\r\n                        http://www.yo-coach.com and Yo!Coach. The Yo!Coach website is a Online language\r\n                        platform for teaching and learning foreign languages. site. By using the\r\n                        Yo!Coach website, you consent to the data practices described in this\r\n                        statement.\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\"><span style=\"font-weight: bold;\">Collection of your\r\n                            Personal Information</span>                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">In order to better provide you with products and services\r\n                        offered on our Site, Yo!Coach may collect personally identifiable information,\r\n                        such as your:\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; First\r\n                        and Last Name\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Mailing\r\n                        Address\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; E-mail\r\n                        Address\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Phone\r\n                        Number\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; credentials\r\n                        and college degrees, certificates etc.\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">If you purchase Yo!Coach\'s products and services, we collect\r\n                        billing and credit card information. This information is used to complete the\r\n                        purchase transaction.\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">Please keep in mind that if you directly disclose personally\r\n                        identifiable information or personally sensitive data through Yo!Coach\'s public\r\n                        message boards, this information may be collected and used by others.\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">We do not collect any\r\n                        personal information about you unless you voluntarily provide it to us.\r\n                        However, you may be required to provide certain personal information to us when\r\n                        you select to use certain products or services available on the\r\n                        Site. These may include: (a) registering for an account on our Site; (b)\r\n                        entering a sweepstakes or contest sponsored by us or one of our partners; (c)\r\n                        signing up for special offers from selected third parties; (d) sending us an\r\n                        email message; (e) submitting your credit card or other payment information\r\n                        when ordering and purchasing products and services on our Site. To wit, we will\r\n                        use your information for, but not limited to, communicating with you in\r\n                        relation to services and/or products you have requested from us. We also may\r\n                        gather additional personal or non-personal information in the future.\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\"><span style=\"font-weight: bold;\">Use of your Personal\r\n                            Information </span>                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">Yo!Coach collects and uses your personal information to\r\n                        operate its website(s) and deliver the services you have requested.\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">Yo!Coach may also use your personally identifiable information\r\n                        to inform you of other products or services available from Yo!Coach and its\r\n                        affiliates.\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\"><span style=\"font-weight: bold;\">Sharing Information\r\n                            with Third Parties</span>                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">Yo!Coach does not sell, rent or lease its customer lists to\r\n                        third parties.\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">Yo!Coach may share data with trusted partners to help\r\n                        perform statistical analysis, send you email or postal mail, provide customer\r\n                        support, or arrange for deliveries. All such third parties are prohibited from\r\n                        using your personal information except to provide these services to Yo!Coach,\r\n                        and they are required to maintain the confidentiality of your information.\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">Yo!Coach may disclose your personal information, without\r\n                        notice, if required to do so by law or in the good faith belief that such\r\n                        action is necessary to: (a) conform to the edicts of the law or comply with\r\n                        legal process served on Yo!Coach or the site; (b) protect and defend the rights\r\n                        or property of Yo!Coach; and/or (c) act under exigent circumstances to protect\r\n                        the personal safety of users of Yo!Coach, or the public.\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\"><span style=\"font-weight: bold;\">Automatically\r\n                            Collected Information</span>                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">Information about your computer hardware and software may be\r\n                        automatically collected by Yo!Coach. This information can include: your IP\r\n                        address, browser type, domain names, access times and referring website\r\n                        addresses. This information is used for the operation of the service, to\r\n                        maintain quality of the service, and to provide general statistics regarding\r\n                        use of the Yo!Coach website.\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\"><span style=\"font-weight: bold;\">Use of Cookies</span>                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">The Yo!Coach website may use \"cookies\" to help you\r\n                        personalize your online experience. A cookie is a text file that is placed on\r\n                        your hard disk by a web page server. Cookies cannot be used to run programs or\r\n                        deliver viruses to your computer. Cookies are uniquely assigned to you, and can\r\n                        only be read by a web server in the domain that issued the cookie to you.\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">One of the primary purposes of cookies is to provide a\r\n                        convenience feature to save you time. The purpose of a cookie is to tell the\r\n                        Web server that you have returned to a specific page. For example, if you\r\n                        personalize Yo!Coach pages, or register with Yo!Coach site or services, a\r\n                        cookie helps Yo!Coach to recall your specific information on subsequent visits.\r\n                        This simplifies the process of recording your personal information, such as\r\n                        billing addresses, shipping addresses, and so on. When you return to the same\r\n                        Yo!Coach website, the information you previously provided can be retrieved, so\r\n                        you can easily use the Yo!Coach features that you customized.\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">You have the ability to accept or decline cookies. Most Web\r\n                        browsers automatically accept cookies, but you can usually modify your browser\r\n                        setting to decline cookies if you prefer. If you choose to decline cookies, you\r\n                        may not be able to fully experience the interactive features of the Yo!Coach\r\n                        services or websites you visit.\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\"><span style=\"font-weight: bold;\">Links</span>                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">This website contains links to other sites. Please be aware\r\n                        that we are not responsible for the content or privacy practices of such other\r\n                        sites. We encourage our users to be aware when they leave our site and to read\r\n                        the privacy statements of any other site that collects personally identifiable\r\n                        information.\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\"><span style=\"font-weight: bold;\">Security of your\r\n                            Personal Information</span>                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">Yo!Coach secures your personal information from unauthorized\r\n                        access, use, or disclosure. Yo!Coach uses the following methods for this\r\n                        purpose:\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; SSL\r\n                        Protocol\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; SSL\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">When personal information (such as a credit card number) is\r\n                        transmitted to other websites, it is protected through the use of encryption,\r\n                        such as the Secure Sockets Layer (SSL) protocol.\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">We strive to take appropriate security measures to protect\r\n                        against unauthorized access to or alteration of your personal information.\r\n                        Unfortunately, no data transmission over the Internet or any wireless network\r\n                        can be guaranteed to be 100% secure. As a result, while we strive to protect\r\n                        your personal information, you acknowledge that: (a) there are security and\r\n                        privacy limitations inherent to the Internet which are beyond our control; and\r\n                        (b) security, integrity, and privacy of any and all information and data\r\n                        exchanged between you and us through this Site cannot be guaranteed.\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\"><span style=\"font-weight: bold;\">Children Under\r\n                            Thirteen</span>                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">Yo!Coach does not knowingly collect personally identifiable\r\n                        information from children under the age of thirteen. If you are under the age\r\n                        of thirteen, you must ask your parent or guardian for permission to use this\r\n                        website.\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\"><span style=\"font-weight: bold;\">Disconnecting your\r\n                            Yo!Coach Account from Third Party Websites</span>                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">You will be able to connect your Yo!Coach account to third\r\n                        party accounts. BY CONNECTING YOUR Yo!Coach ACCOUNT TO YOUR THIRD PARTY\r\n                        ACCOUNT, YOU ACKNOWLEDGE AND AGREE THAT YOU ARE CONSENTING TO THE CONTINUOUS\r\n                        RELEASE OF INFORMATION ABOUT YOU TO OTHERS (IN ACCORDANCE WITH YOUR PRIVACY\r\n                        SETTINGS ON THOSE THIRD PARTY SITES). IF YOU DO NOT WANT INFORMATION ABOUT YOU,\r\n                        INCLUDING PERSONALLY IDENTIFYING INFORMATION, TO BE SHARED IN THIS MANNER, DO\r\n                        NOT USE THIS FEATURE. You may disconnect your account from a third party\r\n                        account at any time. Users may learn how to disconnect their accounts from\r\n                        third-party websites by visiting their \"My Account\" page. Users may\r\n                        also contact us via email or telephone.\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\"><span style=\"font-weight: bold;\">E-mail Communications</span>                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">From time to time, Yo!Coach may contact you via email for\r\n                        the purpose of providing announcements, promotional offers, alerts,\r\n                        confirmations, surveys, and/or other general communication.\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">If you would like to stop receiving marketing or promotional\r\n                        communications via email from Yo!Coach, you may opt out of such communications\r\n                        by Customers may unsubscribe from emails or from the platform by \"replying\r\n                        STOP\" or \"clicking on the UNSUBSCRIBE button. Through email request\r\n                        they can have their profiles removed.\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\"><span style=\"font-weight: bold;\">Changes to this\r\n                            Statement</span>                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">Yo!Coach reserves the right to change this Privacy Policy\r\n                        from time to time. We will notify you about significant changes in the way we\r\n                        treat personal information by sending a notice to the primary email address\r\n                        specified in your account, by placing a prominent notice on our site, and/or by\r\n                        updating any privacy information on this page. Your continued use of the Site\r\n                        and/or Services available through this Site after such modifications will\r\n                        constitute your: (a) acknowledgment of the modified Privacy Policy; and (b)\r\n                        agreement to abide and be bound by that Policy.\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">&nbsp;\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\"><span style=\"font-weight: bold;\">Contact Information</span>                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">Yo!Coach welcomes your questions or comments regarding this\r\n                        Statement of Privacy. If you believe that Yo!Coach has not adhered to this\r\n                        Statement, please contact Yo!Coach at:\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">FATbit Technologies\r\n\r\n\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">Unit No. A-712, Tower A, 7th Floor,\r\n\r\n\r\n                        \r\n						<o:p></o:p>                    </p>                    \r\n					<p class=\"MsoNormal\">Bestech Business Towers, Sector-66,\r\n                        Mohali, Punjab 160066, India\r\n\r\n\r\n                        \r\n				