rder:1px solid #ddd; color:#333; font-weight:bold;\" width=\"40%\">Reason/Comment</td>                                            \n											<td style=\"padding:10px;font-size:13px; color:#333;border:1px solid #ddd;\" width=\"60%\">{admin_comment}</td>                                        \n										</tr>                                    \n									</tbody>                                \n								</table>                            </td>                        \n						</tr>                    \n					</tbody>                \n				</table>            </td>        \n		</tr>    \n	</tbody>\n</table>', '{user_name} Learner/Teacher Name<br>\n{session_type} Class or lesson<br>\n{class_lesson_name} Class or lesson Name<br>\n{schedule_date} Scheduled on<br>\n{start_time} Start time<br>\n{end_time} End time<br>\n{resolution_action} Resolution<br>\n{admin_comment} Comments from admin<br>', 1, 0),
