atus}.</p>                                                                \n                                                                \n								<p style=\"font-size: 14px; line-height: 20px;color: #676767;\"> Admin Comments: {request_comments}</p>                            </td>                        \n						</tr>                    \n					</tbody>                \n				</table>            </td>        \n		</tr>    \n	</tbody>\n</table>', '{user_first_name} - First Name of the email receiver.<br/> \n{user_last_name} - Last Name of the email receiver.<br/> \n{user_full_name} - Full Name of the email receiver.<br/> \n{new_request_status} New Request Status (Approved/Declined) <br> \n{reference_number} Reference Number of the request<br> \n{request_comments} Admin comments<br> \n{website_name} Name of our website<br> ', 1, 0),
