(9, 'Apply to teach static banner section', 9, 1, '\n<section class=\"section section--cta\" style=\"background-image:url(images/cta_2.jpg);\">        \n	<div class=\"container container--narrow\">            \n		<div class=\"cta-content\">                \n			<h2 class=\"margin-bottom-5\">Do you want to become a teacher on Yo!Coach?</h2>                \n			<p class=\"margin-bottom-5\">Connect with thousands of learners around the world and teach from your living room</p>                <a class=\"btn btn--secondary btn--large applytoteach\">Apply Now</a>            </div>        </div>    </section>'),
