(8, 2, 'Apply to teach Become a tutor', '<section class=\"section section--services\">        \r\n	<div class=\"container container--narrow\">            \r\n		<div class=\"section__head \">                \r\n			<h2>How to become a tutor on Yo!Coach?</h2>            </div>            \r\n		<div class=\"section__body\">                \r\n			<div class=\"service--wrapper\">                    \r\n				<div class=\"row\">                        \r\n					<div class=\"col-lg-4\">                            \r\n						<div class=\"service service--vertical\">                                \r\n                          \r\n							<div class=\"service__media\">                                    <img src=\"/images/register.png\" />                                </div>                                \r\n							<div class=\"service__content\">                                    \r\n								<h3>Register on Yo!Coach</h3>                                    \r\n								<p>Excepteur sint proident, occaecat cupidatat non proident, culpa qui officia velit, sed quia non deseruntadipisci proident,</p>                                </div>                            </div>                        </div>                        \r\n					<div class=\"col-lg-4\">                            \r\n						<div class=\"service service--vertical\">                                \r\n							<div class=\"service__media\">                                    <img src=\"/images/cv.png\" />                                </div>                                \r\n							<div class=\"service__content\">                                    \r\n								<h3>Complete Profile</h3>                                    \r\n								<p>Excepteur sint proident, occaecat cupidatat non proident, culpa qui officia velit, sed quia non deseruntadipisci proident,.</p>                                </div>                            </div>                        </div>                        \r\n					<div class=\"col-lg-4\"