(4, 'How can teachers enhance their profiles and make it outstanding?', 1, 1, '2022-04-20 04:58:29'),
(5, 'Is there any feature to record audio and video?', 1, 1, '2022-04-20 04:59:30'),
(6, 'Can teachers teach lessons using a mobile device?', 2, 1, '2022-04-20 05:00:27'),
