INSERT INTO `tbl_faq_lang` (`faqlang_faq_id`, `faqlang_lang_id`, `faq_title`, `faq_description`) VALUES
(1, 1, 'Can the teachers and students check the scheduled lessons as per their time zones?', 'Yes, teachers and students can see the scheduled lessons as per their time zones, simplifying the problem for teachers and students located in different time zones. They can go to \"Settings\" and select their \"Time Zone\".\r\n'),
(1, 2, '          ', '\r\n<pre class=\"tw-data-text tw-text-large tw-ta\" data-placeholder=\"Translation\" id=\"tw-target-text\" dir=\"rtl\" style=\"unicode-bidi: isolate; font-size: 24px; line-height: 32px; background-color: rgb(248, 249, 250); border: none; padding: 2px 0.14em 2px 0px; position: relative; margin-top: -2px; margin-bottom: -2px; resize: none; font-family: inherit; overflow: hidden; width: 270px; white-space: pre-wrap; overflow-wrap: break-word; color: rgb(32, 33, 36);\"><br />\r\n	</pre>'),
(2, 1, 'Is there any feature to record audio and video?', 'The audio/video recording feature depends on the third-party API integrated into the system. The API currently integrated is CometChat that does support the recording functionality. However, we are coming up with a new release of Yo!Coach with a new API - LessonFace that supports audio/video recording.'),
(2, 2, '      ', '\r\n'),
(3, 1, 'Can a teacher reschedule a lesson if he/she misses it?', '\r\n<p dir=\"ltr\" style=\"line-height: 1.8; margin-left: 36pt; text-align: justify; margin-top: 10pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Yes, a teacher can reschedule a lesson if it is missed. To reschedule a lesson:</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.8; margin-left: 72pt; text-align: justify; margin-top: 10pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Sign in to the account. Go to \"Lessons\".</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.8; margin-left: 72pt; text-align: justify; margin-top: 10pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The missed lesson will be listed under the \"Lessons\".</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.8; margin-left: 72pt; text-align: justify; margin-top: 10pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Click on the \"Reschedule Lesson\" icon of the missed lesson.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.8; margin-left: 72pt; text-align: justify; margin-top: 10pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">A pop-up box will open. Mention a comment for rescheduling the lesson for the student and click \"Send\".</span></p>\r\n<div><span style=\"font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br />\r\n		</span></div>'),
(4, 1, 'How can teachers enhance their profiles and make it outstanding?', '\r\n<p dir=\"ltr\" style=\"line-height: 1.8; margin-left: 36pt; text-align: justify; margin-top: 10pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Teachers can include the YouTube link of their introduction video to make it more attractive. They can also include relevant information about themselves like biography, skills, experience, and languages which also helps in making their profile outstanding.</span></p>\r\n<div><span style=\"font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br />\r\n		</span></div>'),
(5, 1, 'Is there any feature to record audio and video?', 'The audio/video recording feature depends on the third-party API integrated into the system. The API currently integrated is CometChat that does support the recording functionality. However, we are coming up with a new release of Yo!Coach with a new API - LessonFace that supports audio/video recording.'),
(6, 1, 'Can teachers teach lessons using a mobile device?', '\r\n<p dir=\"ltr\" style=\"line-height: 1.8; margin-left: 36pt; text-align: justify; margin-top: 10pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Yes, Yo!Coach is mobile responsive and can be used on a mobile device. However, there is no mobile app for it currently.</span></p>\r\n<div><span style=\"font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br />\r\n		</span></div>'),
(7, 1, 'How can students schedule a lesson?', '\r\n<p dir=\"ltr\" style=\"line-height: 1.8; margin-left: 36pt; text-align: justify; margin-top: 10pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">To schedule a lesson:</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.8; margin-left: 36pt; text-align: justify; margin-top: 10pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Sign in to the account. Go to \" Teachers\" which will open a list of teachers registered on the portal.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.8; margin-left: 36pt; text-align: justify; margin-top: 10pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Select a teacher with whom you want to schedule a lesson and go to his/her profile.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.8; margin-left: 36pt; text-align: justify; margin-top: 10pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Students can now either book a free trial session or purchase a lesson.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.8; margin-left: 36pt; text-align: justify; margin-top: 10pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Booking a free trial will open the availability calendar of the teacher. Students can then select a date and time from the calendar and confirm the booking.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.8; margin-left: 36pt; text-align: justify; margin-top: 10pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">To purchase a lesson, students are required to make the payment, and further schedule the lesson as per the availability of the teacher.</span></p>\r\n<div><span style=\"font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br />\r\n		</span></div>'),
(8, 1, 'How do new students get started?', '\r\n<p dir=\"ltr\" style=\"line-height: 1.8; margin-left: 36pt; text-align: justify; margin-top: 10pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">To get started on the platform, students are required to register with their email account and verify it by clicking the link sent on their email address.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.8; margin-left: 36pt; text-align: justify; margin-top: 10pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">After the verification, students can log in and set up their profile like picture, phone number, country, timezone, etc.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.8; margin-left: 36pt; text-align: justify; margin-top: 10pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Students can then search for the teachers as per their requirements by entering the subject/course name.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.8; margin-left: 36pt; text-align: justify; margin-top: 10pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">After shortlisting the teachers, students can book a free trial session with them to have a better understanding of the teacher and see if they both can work together.</span></p>\r\n<p dir=\"ltr\" style=\"line-height: 1.8; margin-left: 36pt; text-align: justify; margin-top: 10pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Post that, the students can select a teacher that suits them and continue with their classes.</span></p>\r\n<div><span style=\"font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br />\r\n		</span></div>'),
(9, 1, 'What are the trial sessions? How can students schedule trial sessions?', '<span id=\"docs-internal-guid-15d95031-7fff-6058-95d4-fd22e51d3c6f\"><span id=\"docs-internal-guid-42a0404f-7fff-9bd5-50a7-e9c15e78f586\">\r\n		<p dir=\"ltr\" style=\"line-height: 1.8; margin-left: 36pt; text-align: justify; margin-top: 10pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Trial sessions are the initial meetings between the teachers and students as a way of exchanging introductions. Teachers give a brief teaching demonstration so that both of them can decide whether working together is a good fit.</span></p>\r\n		<p dir=\"ltr\" style=\"line-height: 1.8; margin-left: 36pt; text-align: justify; margin-top: 10pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Trial sessions last for 30 minutes and are free of cost. Students can book the trial lessons by:</span></p>\r\n		<ul style=\"margin-top: 0px; margin-bottom: 0px; padding-inline-start: 48px;\">\r\n			<li dir=\"ltr\" aria-level=\"1\" style=\"list-style-type: disc; font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre;\">\r\n				<p dir=\"ltr\" role=\"presentation\" style=\"line-height: 1.8; text-align: justify; margin-top: 10pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Find a teacher you want to book a trial with.</span></p></li>\r\n			<li dir=\"ltr\" aria-level=\"1\" style=\"list-style-type: disc; font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre;\">\r\n				<p dir=\"ltr\" role=\"presentation\" style=\"line-height: 1.8; text-align: justify; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">On their detailed information page you will see a \'Book Free Trial\' button.</span></p></li>\r\n			<li dir=\"ltr\" aria-level=\"1\" style=\"list-style-type: disc; font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre;\">\r\n				<p dir=\"ltr\" role=\"presentation\" style=\"line-height: 1.8; text-align: justify; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Clicking the \'Book Free Trial\' button will open their availability calendar from &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; where you can select the date and time for your trial sessions.</span></p></li>\r\n			<li dir=\"ltr\" aria-level=\"1\" style=\"list-style-type: disc; font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre;\">\r\n				<p dir=\"ltr\" role=\"presentation\" style=\"line-height: 1.8; text-align: justify; margin-top: 0pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Click \'Book Lesson\' which will redirect you to the checkout page where you &nbsp; have to \'Confirm Order\'. Your trial lesson is then booked.</span></p></li>\r\n		</ul>\r\n		<p dir=\"ltr\" style=\"line-height: 1.8; text-align: justify; margin-top: 10pt; margin-bottom: 0pt;\"><span style=\"font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">The system allows each student to take one trial lesson per teacher.</span></p>\r\n		<div><span style=\"font-size: 12pt; font-family: Georgia; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\"><br />\r\n				</span></div></span><br />\r\n	\r\n	<p>&nbsp;</p></span>\r\n<p>&nbsp;</p>');
