INSERT INTO `tbl_group_classes` (`grpcls_id`, `grpcls_type`, `grpcls_parent`, `grpcls_slug`, `grpcls_title`, `grpcls_description`, `grpcls_teacher_id`, `grpcls_tlang_id`, `grpcls_duration`, `grpcls_start_datetime`, `grpcls_end_datetime`, `grpcls_teacher_starttime`, `grpcls_teacher_endtime`, `grpcls_total_seats`, `grpcls_booked_seats`, `grpcls_entry_fee`, `grpcls_status`, `grpcls_metool_id`, `grpcls_added_on`) VALUES
(1, 1, 0, 'Learn-Chinese-in-45-minutes!-The-TOP-142-Most-Important-Words-1660891200-1-1', 'Learn Chinese in 45 minutes! The TOP 142 Most Important Words', 'This class will help you learn the top 142 most important words in the Chinese language. These 142 words make up to 58% of words in daily conversations. Weve organized them in groups to make them much easier to learn.', 1, 2, 45, '2022-08-19 06:40:00', '2022-08-19 07:25:00', NULL, NULL, 5, 0, 73.00, 1, 0, '2022-08-19 05:40:00'),
(2, 1, 0, '581-Chinese-Phrases-LEARN-Chinese-FOR-BEGINNERS-1643202300-1-2', '581 Chinese Phrases - LEARN Chinese FOR BEGINNERS', 'Have you ever wanted to learn Chinese? With over 32 million native speakers across the globe, its the second most spoken language in the entire world. Its also considered to be one of the most romantic languages! But are those enough reasons to choose to learn Chinese out of all the languages you could be learning?', 1, 2, 15, '2022-01-26 13:05:00', '2022-01-26 13:20:00', NULL, NULL, 17, 0, 56.00, 1, 0, '2022-01-26 12:05:00'),
(3, 1, 0, 'Chinese-Conversation-for-Beginners-|-464-Basic-Chinese-Phrases-To-Know-1648964100-3-1', 'Chinese Conversation for Beginners | 464 Basic Chinese Phrases To Know', 'In this class, you\'ll learn 464 basic Chinese phrases to help you learn Chinese fast. Our native English speaker will say each phrase, then our native Chinese speaker will repeat the phrase in Chinese. These easy Chinese phrases are good for friendships, relationships, dating, or just meeting a stranger in a Chinese-speaking country. Watching and listening to native Chinesespeakers is the fastest way to learn Chinese, so start with this Chinese Conversation for Beginners lesson.', 3, 2, 90, '2022-04-03 05:35:00', '2022-04-03 07:05:00', NULL, NULL, 19, 0, 26.00, 1, 0, '2022-04-03 04:35:00'),
(4, 1, 0, 'Learn-Chinese-for-Beginners:-649-Basic-Chinese-Sentences-in-15-minutes-|-SUPER-EASY-Chinese-Course-1663050300-3-2', 'Learn Chinese for Beginners: 649 Basic Chinese Sentences in 15 minutes | SUPER EASY Chinese Course', 'This knowledge prepares students to effectively communicate in Chinese on a limited range of topics related to everyday situations. Students practice listening and speaking in real-life situations, learn to read and write Chinese characters.', 3, 2, 15, '2022-09-13 06:25:00', '2022-09-13 06:40:00', NULL, NULL, 6, 0, 73.00, 1, 0, '2022-09-13 05:25:00'),
(5, 1, 0, '261-Essential-Chinese-Words-for-Tourists-and-Beginners-1639952100-3-3', '261 Essential Chinese Words for Tourists and Beginners', 'Learn Chinese language speaking for tourists course is beginners level course which teaches you essential Chinese words and common Chinese sentences which you can use to start speaking Chinese language with the locals and your friends. This to the point and precise course aims to enable you to start communicating in Chinese.', 3, 2, 60, '2021-12-19 22:15:00', '2021-12-19 23:15:00', NULL, NULL, 18, 0, 31.00, 1, 0, '2021-12-19 21:15:00'),
(6, 1, 0, 'Learn-ALL-Chinese-Alphabet-in-30-Minutes-How-to-Write-and-Read-Chinese-1646066100-3-4', 'Learn ALL Chinese Alphabet in 30 Minutes - How to Write and Read Chinese', 'In this lesson, youll be able to learn everything you need to know about Chinese writing. We will teach you how to WRITE and READ characters of the Chinese alphabet. We will teach you those using simple steps and giving you common Chinese words. If you want to get started reading and writing Chinese, this is THE place to start.', 3, 2, 30, '2022-02-28 16:35:00', '2022-02-28 17:05:00', NULL, NULL, 5, 0, 54.00, 1, 0, '2022-02-28 15:35:00'),
(7, 1, 0, 'Learn-English-in-45-Minutes-ALL-Basics-Every-Beginners-Need-1651284300-4-1', 'Learn English in 45 Minutes - ALL Basics Every Beginners Need', 'In this lesson, youll discover the best way to get started with your English studies. You\'ll be given learning strategies, tips but also all the grammar and vocabulary you need to understand the basis of English language. This is THE place to start if you want to start learning English, and improve both your listening and speaking skills.', 4, 1, 45, '2022-04-30 02:05:00', '2022-04-30 02:50:00', NULL, NULL, 8, 0, 27.00, 1, 0, '2022-04-30 01:05:00'),
(8, 1, 0, 'Learn-All-English-Alphabet-in-120-minutes-hour-How-to-Write-and-Read-English-1662567000-4-2', 'Learn All  English Alphabet in 120 minutes/hour - How to Write and Read English', 'In this class, youll be able to learn everything you need to know about English writing. We will teach you how to WRITE and READ characters of the  English alphabet. We will teach you those using simple steps and give you common English words. If you want to get started reading and writing  English, this is THE place to start.', 4, 1, 120, '2022-09-07 16:10:00', '2022-09-07 18:10:00', NULL, NULL, 19, 0, 61.00, 1, 0, '2022-09-07 15:10:00'),
(9, 1, 0, 'Complete-English-Course:-Learn-English-in-30-minutes!-1664517000-4-3', 'Complete English Course: Learn English in 30 minutes!', 'Start mastering the English language in a fast and easy way! If you have ever dreamed of traveling to other places and speaking like a native, this complete course is perfect for you!', 4, 1, 30, '2022-09-30 05:50:00', '2022-09-30 06:20:00', NULL, NULL, 7, 0, 59.00, 1, 0, '2022-09-30 04:50:00'),
(10, 1, 0, 'Learn-ALL-English-Alphabet-in-90-Minutes-How-to-Write-and-Read-English-1659944400-5-1', 'Learn ALL English Alphabet in 90 Minutes - How to Write and Read English', 'In this lesson, youll be able to learn everything you need to know about English writing. We will teach you how to WRITE and READ characters of the English alphabet. We will teach you those using simple steps and giving you common English words. If you want to get started reading and writing English, this is THE place to start.', 5, 1, 90, '2022-08-08 07:40:00', '2022-08-08 09:10:00', NULL, NULL, 13, 0, 60.00, 1, 0, '2022-08-08 06:40:00'),
(11, 1, 0, 'Basic-English-Words-Slow-Simple-daily-English-words-1658989200-5-2', 'Basic English Words Slow & Simple daily English words', 'Learning English gives you access to communicate with many people and connect on a deeper level, not just in Asia but across the world! Studies suggest that learning English uses more parts of the brain than are required for other languages.', 5, 1, 45, '2022-07-28 06:20:00', '2022-07-28 07:05:00', NULL, NULL, 14, 0, 53.00, 1, 0, '2022-07-28 05:20:00'),
(12, 1, 0, 'Learn-Hindi-for-beginners!-Learn-important-Hindi-words-phrases-grammar-fast!-1647752400-7-1', 'Learn Hindi for beginners! Learn important Hindi words, phrases & grammar - fast!', 'If you want to learn Hindi, then you should listen and speak as often as you can in a daily routine. I will show you the best way to learn Hindi for beginners: This class will help you improve your Hindi speaking and listening skills.', 7, 4, 60, '2022-03-20 05:00:00', '2022-03-20 06:00:00', NULL, NULL, 17, 0, 21.00, 1, 0, '2022-03-20 04:00:00'),
(13, 1, 0, 'Learn-Hindi-in-45-Minutes-ALL-the-Basics-You-Need-1644487500-7-2', 'Learn Hindi in 45 Minutes - ALL the Basics You Need', 'In this class, youll get started with Hindi. You will discover the key points of Hindi Grammar! This is THE place to start if you want to start learning Hindi.', 7, 4, 45, '2022-02-10 10:05:00', '2022-02-10 10:50:00', NULL, NULL, 16, 0, 25.00, 1, 0, '2022-02-10 09:05:00'),
(14, 1, 0, 'Learn-how-to-say-the-letters-and-sounds-in-Hindi-1654940100-7-3', 'Learn how to say the letters and sounds in Hindi ', 'Hindi for Beginners - I will teach you every single letter and sound in the Hindi alphabet. From the A to the Z in Hindi. You will learn how to pronounce Hindi letters.', 7, 4, 90, '2022-06-11 09:35:00', '2022-06-11 11:05:00', NULL, NULL, 15, 0, 19.00, 1, 0, '2022-06-11 08:35:00'),
(15, 1, 0, '485-Spanish-Words-for-Everyday-Life-Basic-Vocabulary-1654116300-9-1', '485 Spanish Words for Everyday Life - Basic Vocabulary', 'In this class, we will teach you the core 485 Spanish words that you must know if you\'re an absolute beginner', 9, 3, 90, '2022-06-01 20:45:00', '2022-06-01 22:15:00', NULL, NULL, 8, 0, 66.00, 1, 0, '2022-06-01 19:45:00'),
(16, 1, 0, 'Learn-Spanish-in-120-Minutes-All-the-Spanish-Basics-You-Need-1652299800-9-2', 'Learn Spanish in 120 Minutes - All the Spanish Basics You Need', 'This course emphasizes the fundamental language skills of reading, writing, speaking, listening, thinking, viewing, and presenting. An emphasis on vocabulary and composition skills will be an ongoing part of the program. The course includes studies of various literary genres: short stories, poetry, novel, drama, and non-fiction. The development of critical reading and writing skills is a major emphasis of the course.', 9, 3, 120, '2022-05-11 20:10:00', '2022-05-11 22:10:00', NULL, NULL, 14, 0, 67.00, 3, 0, '2022-05-11 19:10:00'),
(17, 1, 0, 'Essential-Spanish:-Learn-over-580-Spanish-Words-Phrases-1651839000-10-1', 'Essential Spanish: Learn over 580 Spanish Words & Phrases', 'With this class, you will learn vocabulary and phrases that you could easily come across in everyday conversation. Despite what you may have heard, you really don\'t need to stress yourself out trying to memorize hundreds of different grammar rules and spending long hours drilling grammar exercises to learn a foreign language.', 10, 3, 15, '2022-05-06 12:10:00', '2022-05-06 12:25:00', NULL, NULL, 9, 0, 77.00, 1, 0, '2022-05-06 11:10:00'),
(18, 1, 0, '672-Spanish-Words-for-Everyday-Life-Basic-Vocabulary-1646882400-10-2', '672 Spanish Words for Everyday Life - Basic Vocabulary', 'Spanish can be very difficult in terms of pronunciation, due to intricacies like silent letters, multiple sounds for a single letter, and endless exceptions to whatever rules you find. This site contains numerous lessons which explain the rules and exceptions of Spanish pronunciation in great detail, which is fine for advanced students but can be very confusing for beginners.', 10, 3, 120, '2022-03-10 03:20:00', '2022-03-10 05:20:00', NULL, NULL, 16, 0, 29.00, 1, 0, '2022-03-10 02:20:00'),
(19, 1, 0, '534-Spanish-Words-for-Everyday-Life-Basic-Vocabulary-1661455200-10-3', '534 Spanish Words for Everyday Life - Basic Vocabulary', 'Spanish can be very difficult in terms of pronunciation, due to intricacies like silent letters, multiple sounds for a single letter, and endless exceptions to whatever rules you find. This site contains numerous lessons which explain the rules and exceptions of Spanish pronunciation in great detail, which is fine for advanced students but can be very confusing for beginners.', 10, 3, 15, '2022-08-25 19:20:00', '2022-08-25 19:35:00', NULL, NULL, 19, 0, 28.00, 1, 0, '2022-08-25 18:20:00'),
