(240, 1, 300, 1, 76, 22, 5, 'Amazing Place to Learn!!', 'I had very few problems and when I did Lydia Deckow was always right there to help me out and answer all of my questions.', 1, 0, '2022-05-16 08:07:00'),
(241, 1, 301, 1, 76, 22, 5, 'Learning A Language Requires Excellet Support', 'Yo!Coach is a highly professional operation where all the people understand that learning a language requires excellent support for both teachers and learners.', 1, 0, '2022-05-12 13:14:00'),
(242, 1, 302, 1, 76, 22, 4, 'I Will Continue to Use This platform for The Future', 'I am very pleased with the classes and my trainer.I will continue to use them for the future.', 1, 0, '2022-05-13 09:56:00'),
(243, 1, 303, 1, 76, 22, 5, 'Lydia Deckow Adapted Early On To My Needs As An Intermediate-Level Student', 'My online English sessions are going very well, and Lydia Deckow is an excellent teacher!', 1, 0, '2022-04-27 16:09:00'),
(244, 1, 304, 1, 82, 42, 5, 'Great platform for Online Learning', 'Outstanding approach to make people learn a new language. Excellent visualisation. They really put a lot of effort into it!', 1, 0, '2022-03-25 15:10:00'),
(245, 1, 305, 1, 82, 42, 5, 'Excellent Service', 'It was a wonderful experience. Ashlynn Pacocha is a fantastic teacher and resource.', 1, 0, '2022-04-08 01:10:00'),
(246, 1, 306, 1, 82, 42, 5, 'I love learning from this platform', 'I love learning from this platform. Highly Satisfied!!', 1, 0, '2022-03-20 00:55:00'),
(247, 1, 307, 1, 82, 42, 5, 'Very Good At Planning Lessons', 'Ashlynn Pacocha is a fantastic teacher, really very good at planning lessons taking me through any questions I may have.', 1, 0, '2022-03-26 00:55:00'),
(248, 1, 308, 1, 82, 42, 4, 'Amazing platform to Use', 'This is an amazing website to use for both professional and personal development.', 1, 0, '2022-04-13 17:05:00'),
(249, 1, 310, 1, 83, 14, 4, 'I Learned Way More With Rita Tremblay In Just A Few Months', 'I loved my course; it was really great and I learned a lot! Rita Tremblay was a great teacher and very patient.', 1, 0, '2022-01-14 13:57:00'),
(250, 1, 311, 1, 83, 14, 5, 'Choose Yo!Coach Because You Offer Face-To-Face Tutoring', 'I choosed Yo!Coach mainly because you offer face-to-face tutoring and have a lot of corporate clients. I am thoroughly enjoying the lessons. Rita Tremblay is doing an excellent job of teaching me.', 1, 0, '2022-01-16 12:15:00'),
(251, 1, 312, 1, 83, 47, 4, 'Great Courses In A Great platform', 'The thing I love most about this e-learning platform is how full of the most useful course is! Courses content is always a trend and update.', 1, 0, '2021-12-27 21:44:00'),
(252, 1, 313, 1, 83, 47, 4, 'Naomi Sipes Is Very Good At Teaching', 'The Finnish lessons are going well! Naomi Sipes is very good and always focuses on the topics where we need more training.', 1, 0, '2021-12-24 04:02:00'),
(253, 1, 314, 1, 83, 47, 4, 'Thankyou For Your Services', 'Naomi Sipes professor, Your way of teaching is really great and thank you very much for your services', 1, 0, '2021-12-18 04:50:00'),
(254, 1, 315, 1, 83, 47, 4, 'I Learned Way More With Naomi Sipes In Just A Few Months', 'I loved my course; it was really great and I learned a lot! Naomi Sipes was a great teacher and very patient.', 1, 0, '2021-12-20 06:32:00'),
(255, 1, 316, 1, 83, 57, 4, 'I Am Happy With The Knowledge And Experience of My Teacher', 'Isom Jaskolski is a very talented and experienced Portuguese teacher, and Im very glad. I am very pleased with Language Trainers too.', 1, 0, '2022-03-30 01:37:00'),
(256, 1, 317, 1, 83, 57, 5, 'Made Me to Achieve My Impossible Goals', 'This is a really amazing platform! My teacher Isom Jaskolski is great and helps me a lot to learn quickly.', 1, 0, '2022-03-27 05:31:00'),
(257, 1, 318, 1, 83, 57, 5, 'Well Prepared Lectures', 'I have only had positive experiences with Yocoach courses. The lectures are well prepared, and they are just long enough to give a good explanation.', 1, 0, '2022-03-28 16:57:00'),
(258, 1, 319, 1, 88, 37, 4, 'An Awesome Experience With Yo!Coach', 'I have a very interesting experience withYo!Coach as all the teachers are great.', 1, 0, '2022-01-26 22:01:00'),
(259, 1, 321, 1, 88, 37, 5, 'Best Language Learning platform', 'The only language learning platform which actually benefited me.', 1, 0, '2022-01-13 13:35:00'),
(260, 1, 322, 1, 88, 37, 4, 'Easy to Use', 'I like the easy navigation and the fact that we can choose certain courses based on the language we want to learn. Devyn Kirlin is really great!!', 1, 0, '2022-01-13 17:25:00'),
(261, 1, 323, 1, 88, 37, 5, 'I Would Love To Buy More Classes', 'The lessons are fantastic! I love the class and I feel like Devyn Kirlin is the best teacher I could have been placed with!', 1, 0, '2022-01-15 08:02:00'),
(262, 1, 324, 1, 93, 34, 4, 'Enjoying my Classes!!', 'The course is going really well. I\'m enjoying my classes with Lacy Champlin.', 1, 0, '2022-04-05 17:59:00'),
(263, 1, 325, 1, 93, 34, 5, 'Fantastic Online School', 'It\'s the best online school I\'ve ever been working with in these past years. I know several course coordinators that I consider almost friends, still very professional and helpful.', 1, 0, '2022-04-22 04:38:00'),
(264, 1, 327, 1, 96, 89, 4, 'Variety and Diversification of Courses', 'This is really great about Matt Pollich that a variety of courses are offered.', 1, 0, '2022-05-25 04:12:00'),
(265, 1, 330, 1, 96, 42, 4, 'An Amazing Language Learning platform for all', 'Great website. I\'ve engaged in a lot of language exchanges on this site with Ashlynn Pacocha', 1, 0, '2022-01-22 00:13:00'),
(266, 1, 331, 1, 96, 42, 4, 'Great Tool For Self-Motivated Learning', 'I enjoy the variety of classes offer and the structure of the programs. All of the programs are conducted with high levels of professionalism, and make learning outcomes easy to achieve and understand.', 1, 0, '2022-01-11 16:50:00'),
(267, 1, 332, 1, 96, 42, 4, 'Ashlynn Pacocha Adapted Early On To My Needs As An Intermediate-Level Student', 'My online Chinese sessions are going very well, and Ashlynn Pacocha is an excellent teacher!', 1, 0, '2022-01-11 22:25:00'),
(268, 1, 333, 1, 96, 42, 5, 'Flexible Class Hours', 'My teacher Ashlynn Pacocha is very helpful and we have flexible class hours.', 1, 0, '2022-01-02 11:16:00'),
(269, 1, 335, 1, 96, 51, 5, 'I Am Looking Forward To The Future Lessons', 'I enjoyed my first Chinese lesson and Zoila Lemke is an excellent teacher and help me to understand what I need in order to enhance my Chinese skills. I\'m looking forward to the future lessons.', 1, 0, '2022-01-05 04:11:00'),
(270, 1, 336, 1, 96, 51, 5, 'Realy Enjoyed My Chinese Classes', 'My teacher, Zoila Lemke, was wonderful. I really enjoyed my Chinese classes!', 1, 0, '2021-12-26 12:57:00'),
(271, 1, 337, 1, 96, 51, 4, 'Always Ready to Help Me Out', 'I had very few problems and when I did they were always right there to help me out and answer all of my questions.', 1, 0, '2021-12-31 10:44:00'),
(272, 1, 338, 1, 100, 23, 4, 'Improvement in My pronounciation', 'Arabic classes are going well. My teacher, Brandt Jacobs, is very patient and I am improving in my pronunciation!', 1, 0, '2022-05-26 23:30:00'),
