INSERT INTO `tbl_users_lang` (`userlang_user_id`, `userlang_lang_id`, `user_biography`) VALUES
(1, 1, 'Hi Students! I\'m Devin Abernathy and I belong to Grenada. I developed my love for teaching in high school, and I particularly enjoy teaching Italian, Tamil. Teaching online is a fantastic opportunity because I can work around my students\' schedules! Having spent the last few years overseas and majoring in all the languages at the College of William and Mary. I can communicate comfortably in both languages and loves the challenges that language brings!'),
(1, 2, '  !       .                 .            !                 .          !'),
(3, 1, 'Hi everyone! I am Cathy Beier. I am enthusiastic about teaching students different languages like Hindi, Russian, Punjabi. I believe in the importance of modern technology and am always looking for new and creative ways to use it in the sessions. I completed my education from Nauru.'),
(3, 2, '  !   .          .              .    .'),
(4, 1, 'Hello everyone! I am Pierce Dach and I\'ve worked in language learning and skills service for above 8 years. I speak multiple languages like Bihari languages, Macedonian, Punjabi, Volapk and will also help you all to learn the same. The goal of language learning is to enhance fluency by improving vocabulary and structure. I will make language learning more convenient for you.'),
(4, 2, ' !             8 .                 .            .      .'),
(5, 1, 'I\'m a self-starter with a lot of enthusiasm who can work quickly and efficiently. I began teaching languages in 2014 and am continuously learning more about this profile. I make learning enjoyable for students by allowing them to talk freely, make errors, and learn at their own speed and style.'),
(5, 2, '          .      2014       .                .'),
(7, 1, 'I have been living and teaching Chinese in Belarus from last 17 years. I focus on fluency and breeding confidence, allowing my students to find their own flow and, therefore, improve at their own pace.'),
(7, 2, '        17 .                   .'),
(9, 1, 'Since 1998, I\'ve been living and teaching Chinese, Bengali, Punjabi in Bolivia. I want all kids to be effective learners, so I aim to establish an exciting, encouraging, and adaptable classroom environment for their various needs. I\'ve also worked as a magazine editor and am the author of two books.'),
(9, 2, '  1998         .                     .       .'),
(10, 1, 'Hello Everyone! I\'m Ora Kuvalis. I\'m a professional Hindi trainer with over 18 years of teaching experience and about 1392 lessons under my belt. I tailor my instruction to each individual learner, concentrating on their specific needs and laying the groundwork for their language success.'),
(10, 2, '  !   .        18       1392   .                .'),
(13, 1, 'Hello, everyone!! I\'m originally from Dominican Republic, and while I\'m a self-proclaimed language nerd with a solid academic foundation, I prefer to make my training sessions as practical, hands-on, and engaging as possible. I enjoy using real materials to help my students improve their active vocabulary, as well as competence-based scenarios to practise functional language commonly used in the workplace. I love teaching Russian and would love to share my teachings with you.'),
(13, 2, ' !!                                 .                           .         .'),
(14, 1, 'I received a master\'s degree in Spanish, Hindi, Bengali, Punjabi from the University of North Dakota. I have experience with the both one-on-one and group tutoring.'),
(14, 2, '                 .      .'),
(16, 1, 'In 2013, I started teaching English, Arabic in Mauritania. I make every effort to create a welcoming and comfortable environment in which learners want to learn and play with the language. I adopt communicative and task-based teaching strategies to assist students in the learning process, and I link course objectives with my students\' needs and expectations. I also love to speak Bambara, Chuvash, Hebrew, Volapk.'),
(16, 2, '  2013        .              .                   .         .'),
(17, 1, 'Hello Everyone! I\'m Jarod Dach and I hail from Albania. I\'m a highly motivated, energetic, and committed instructor who wants all students to succeed. I love to teach Hindi and will also help you all in the same. Nice to meet you!!'),
(17, 2, '  !      .           .           .  !!'),
(18, 1, 'With over 14 years of experience in the language teaching profile, I have my expertise in Hindi, Italian, Tamil, Swedish I\'m a professional educator with a solid track record of encouraging child-centered curriculum and student innovation. I constantly strive to get the most out of my students. '),
(18, 2, '    14                                 .       .'),
(20, 1, 'Hey Peeps! I\'m Mustafa Dicki and I\'m quite enthusiastic about sharing not only the specifics of the subject but also the overall tale of language. I collaborate with my students to identify and address their unique needs, skills, and areas of interest, all while focusing on language\'s primary goal: the capacity to effectively express oneself and communicate with others. I think about how I can convey, clarify, and push the learner in their language learning process as a mentor.'),
(20, 2, ' !                .                    :          .              .'),
(21, 1, 'In the Bermuda, I began teaching as a volunteer teacher for immigrants. I\'ve taught Italian, Swedish in Bermuda, primarily in the financial sector, and Stuttgart, primarily in the automotive sector, since migrating to Europe. My teaching technique focuses on establishing a personal relationship with each student.'),
(21, 2, '        .                           .            .'),
(22, 1, 'Hello All! I\'ve been educating students of all abilities and cultures online for more than 18 years. I\'ve developed curricula and led teacher training and parenting workshops in the past. I speak Norwegian, Tswana very fluently.'),
(22, 2, ' !             18 .            .     .'),
(23, 1, 'Hello Students! I\'m Brandt Jacobs and I belong to Austria. I served as an educational writer for several newspapers across Midwest and East Coast sparked my interest in teaching. I assist students in honing their writing talents and broadening their knowledge of literature. concentrating on the problem areas and helping students in communicating more effectively'),
(23, 2, '  !       .                .          .           '),
(24, 1, 'Hi All! I\'ve been teaching foreign languages to a diverse group of students in Seychelles since 2014. People fascinate me, especially how they interact with one another and communicate. On occasion, I also work as a translator and editor.'),
(24, 2, '  !             2014.           .        .'),
(27, 1, 'My work and education have prepared me to teach French, Hebrew-Israel. I have learned to speak Indonesian, Kashmiri. After learning about the real-world challenges of written and vocal communication, I decided to assist learners in learning more effectively.'),
(27, 2, '       .      .                  .'),
(28, 1, 'Hello Students! I\'m Cameron Annie and I\'ve worked with students from a variety of backgrounds in the private and public sectors, from the classroom to the Jobsite. I\'ll help you all to learn Japanese, Swedish and also help you to progress. Many of the students want to practice the types of meetings, talks, and presentations that I have done as a teacher.'),
(28, 2, '  !                     .          .               .'),
(29, 1, 'Hello Everyone! I am pleased to be your Chinese teacher this year.  I am very interested in having your support and working as a team with your family in order to have a very successful school year.'),
(29, 2, '  !        .                  .'),
(30, 1, 'This year, I am honored to be your language instructor. I have around 19 years of experience as a Punjabi instructor. I am extremely interested in receiving your support and collaborating with your family to have a good school year.'),
(30, 2, '       .   19     .             .'),
(32, 1, 'I\'m Kobe Nicolas and I am a Mexican native who has worked in teaching for 7 years. I graduated from Holy Family University with a master\'s degree in education and the Instituto Politecnico Nacional in Mexico City with a bachelor\'s degree in architecture. My personal experience is used to implement my teaching methods.'),
(32, 2, '           7 .                      .         .'),
(34, 1, 'Hi Everyone! I\'m Lacy Champlin. From my past experience, I recognize that each student\'s learning process has various strengths and shortcomings. As a result, I\'m devoted to providing individualized instruction in my class, as well as a number of ways for my pupils to reach their objectives. Nonetheless, learning a language necessitates practice, dedication, and memorizing abilities. I\'ll ask for your help at home to help us meet our objective this year.'),
(34, 2, ' !   .                 .                    .           .          .'),
(35, 1, 'I\'ve been teaching since 1995 when I graduated from university, and I\'ve spent a lot of time in the classroom. I\'ve taught multiple languages like Spanish, Punjabi, French, Hebrew-Israel and I work in a secondary school in south-east Poland with students aged 11 to 16. I\'m a language instructor.'),
(35, 2, '     1995           .                         11  16 .   .'),
(36, 1, 'For over 9 years, I\'ve worked in education in a variety of capacities and taught Tamil as a Teaching Assistant and Cover Supervisor. I\'ve always had a strong desire to travel as well as a desire to teach. I enjoy dealing with children because it allows them to express themselves creatively.'),
(36, 2, '  9                    .           .             .'),
(37, 1, 'Hello All! I\'m Devyn Kirlin and I belong to Comoros. In my teaching experience, I have taught hundreds of students and have my expertise in Chinese, Italian, Hebrew-Israel, Finnish. I\'m a people person who enjoys meeting individuals from all cultures and places. I see the classroom as a stage and each instruction as a performance. I get butterflies in my stomach before every lesson, regardless of level.'),
(37, 2, '  !        .                   .         .       .            .'),
(38, 1, 'Hey Students! I would love to teach you Chinese. I\'ve participated in a variety of training courses and sessions throughout my life and have progressed in each field as a result, earning numerous awards and certifications. My ability to lead by example is one of my strongest assets. I am a trustworthy, industrious, dependable, and supportive individual.'),
(38, 2, ' !    .                        .          .         .'),
(39, 1, 'Hello, everyone! I\'ve been teaching for more than two years and a half. Following my post-graduate studies, I earned a Certificate in Teaching Other Languages from the University of Cambridge. Working with both adult and young learners has taught me that they each have their own set of opportunities and obstacles.'),
(39, 2, '  !      .              .                  .'),
(40, 1, 'I\'m Kim Labadie. I hold a master\'s degree in Arabic. I also hold a Cambridge Certificate in Teaching Languages to Speakers of Other Languages. One of the few areas where I am aware and myself is in the classroom. When I am not teaching, I like watching films and television series, and reading about them.'),
(40, 2, '   .       .            .           .             .'),
(42, 1, 'For over 10 years, I\'ve been training students and working professionals in languages like Chinese, Arabic. I am a qualified teacher trainer and content writer with 10 years of experience working with the British Council in Guatemala. I am an inclusive educator who enjoys incorporating lessons for both mainstream and differently-abled students.'),
(42, 2, '   10            .        10           .             .'),
(43, 1, 'Hi Everyone! My name is Donnie Tillman. I achieved a few qualifications in Bengali teaching that have helped me in living and creating a cooperative community in the classroom, and model for students the value of mutual respect and teamwork among all members of the community.'),
(43, 2, '  !   .                              .'),
(45, 1, 'My name is Ansel Haley and I\'ve been working at the British Council Teaching Centre. I love teaching languages like English, Italian. My teaching career began as a schoolteacher, and I now have over 11 years of experience. Despite having a commerce degree, I chose to teach because I found classrooms to be a fascinating place where people of all ages and genders found themselves creating and discovering their identities.'),
(45, 2, '          .      .           11   .                             .'),
(46, 1, 'In August 2002, I began teaching at Works for USP, a El Salvador based nonprofit. I spent a year working at Milton Keynes College in the El Salvador before joining the British Council in October 2002. Since then, I\'ve been instructing young students in a variety of courses at various levels. I believe all learners to be fascinating and diverse in their talents. I believe that every learner should have something to take away from every class.'),
(46, 2, '   2002     Works for USP       .                   2002.                .        .             .'),
(47, 1, 'Hello All! I\'m Naomi Sipes and I began my work as a banker, but my strong desire to teach languages led me to change careers. I\'ve taught multiple languages like Chinese, Swedish. I have a Cambridge University Certificate in Language Teaching. A language school, in my mind, is an enriching interaction of individuals that builds mutual love and acceptance of differences in society.'),
(47, 2, ' !                 .        .       .                 .'),
(48, 1, 'Since 1999, I\'ve been a teacher. I love teaching Japanese language. I have a natural affinity for the language, so I decided to teach it. I\'ve taught a variety of courses for adults, including Business Communication Skills, Everyday English, Spoken English, and IELTS preparation courses, as well as Young Learners.'),
(48, 2, '  1999  .    .         .                             IELTS     .'),
(49, 1, 'I enjoy teaching because it is satisfying to assist others in achieving their objectives. My classes are always active and exciting. I feel that an engaging and enjoyable learning atmosphere can help students learn more effectively.'),
(49, 2, '          .    .               .'),
(51, 1, 'Hi Students! My name is Zoila Lemke and I have expertise instructing both adults and children. As a senior teacher, I collaborated on the project in 1997 with the Directorate of Education and Trinity College, Spain. I have taught Chinese, Japanese, Hebrew-Israel languages in my teaching experience. Prior to that, I worked at several institutions such as the Army Wives Welfare Association\'s School of English and Hindustan Times Learning Centre, where I taught learners of various capacities. I am a happy person who enjoys interacting with others.'),
(51, 2, ' !  Zoila Lemke        .          1997       .           .                             .       .'),
(52, 1, 'I\'m Savanna Collier and my sincere goal is to make my classes learner-centered, participatory, and enjoyable. I have my expertise in teaching Spanish, French languages. I always look forward to learning new things in order to improve my teaching standards, and I am a firm believer in the organization\'s and my personal growth by continuing to work on my professional development.'),
(52, 2, '              .       .                             .'),
(54, 1, 'Hi Kids! I\'m Libbie Douglas and I\'m committed to teaching in a dynamic and practical manner so that students gain information and have hands-on experience with the language. To make learning as natural and efficient as possible, I use unique ideas and assistance.'),
(54, 2, ' !                  .           .'),
(55, 1, 'I\'m Berneice Mraz and I\'m from Uruguay, then relocated to Uruguay after college. I have taught Chinese for more than 13 years. I teach in an informal manner and enjoy being creative while creating things. I\'ve been exposed to a variety of cultures and have always valued diversity in society. I enjoy teaching because it allows me to learn about different people.'),
(55, 2, '             .        13 .           .             .          .'),
(56, 1, 'In 2008, I finished a British Council-sponsored and approved teacher preparation programme. I\'ve worked with students at all levels, from elementary to advanced. I\'ve taught a wide range of courses across the curriculum, including corporate English, general English, and spoken English. In addition, I have assisted students in IELTS preparation classes and Teacher Training programmes.'),
(56, 2, '  2008          .            .                         .           IELTS   .'),
(57, 1, 'Hi Everyone! I\'m Isom Jaskolski and I earned a Certificate in Bengali Teaching to Speakers of Other Languages (CELTA). Apart from teaching Young Learner classes, I have taught all of the courses offered by the center, including Spoken English, Business Communication Skills, Everyday English, and IELTS. I enjoy engaging with individuals of all ages and sharing my life experiences.'),
(57, 2, '  !  Isom Jaskolski          (CELTA).                              IELTS.            .'),
(58, 1, 'Hello, everyone! With over 17 years of experience in education and community service, I am a self-directed, action-oriented professional. I have taught Hindi, Italian languages and I am responsible for the training and development of all teachers and learners around the world in addition to teaching.'),
(58, 2, ' !    17              .                     .'),
(59, 1, 'My name is Orlando Kub  and I\'m working as a teacher has been both life-changing and fulfilling for me; I am more like a kind and compassionate teacher who wants all students to be successful learners and seeks to establish a classroom environment that is interesting, encouraging, and adaptable to students\' diverse needs.'),
(59, 2, '                                      .'),
(60, 1, 'Greetings, Students! I\'m Johnnie Cremin and I\'ve worked with students of all ages and have taught a variety of languages as English, Chinese, Punjabi, Tamil and also provide training for the certification for EC and IELTS. I\'ve also taught IELTS Masterclass to IELTS trainers. I have also completed the online teacher training program (OTT) and have experience teaching online.'),
(60, 2, ' !                             EC  IELTS.     IELTS Masterclass  IELTS.         (OTT)      .'),
(61, 1, 'Hello, Students! My name is Wendell Kautzer and I have 18 years of language teaching experience. In my tenure, I\'ve taught multiple languages as Punjabi, French, Finnish. After getting my Diploma in Teaching, I became interested in teaching languages. I\'ve started looking at teacher education and I\'m loving it. Because of their enormous potential and originality, I enjoy dealing with young people.'),
(61, 2, '  !  Wendell Kautzer  18      .            .          .       .         .'),
(63, 1, 'Hi All! I\'m Karlie Keebler and for almost 7 years, I\'ve been teaching foreign languages. I\'ve taught a variety of language enhancement classes to students ranging from elementary to advanced. One of my main interests is phonetics, and you\'ll notice that I frequently incorporate aspects of pronunciation into my classes.'),
(63, 2, ' !       7       .               .                .'),
(64, 1, 'I\'m Celine Kilback and I am attentive, well-organized, and eager to teach and apply new concepts. I love teaching English language and would help you to learn it. When teaching, I enjoy paying close attention to details and have a strong rapport with students. My management experience allows me to completely comprehend how to deal with problems and produce answers and outcomes.'),
(64, 2, '            .       .             .              .'),
(65, 1, 'Hello Students!! I\'m Carolanne Kub and I am dedicated to encouraging young brains and ensuring that every child realizes their full potential. I would help you to learn Portuguese, Japanese. To reach this goal, I provide classes in a way that makes language acquisition as engaging and practical as feasible.'),
(65, 2, '  !!               .     .               .'),
(67, 1, 'Hi Kids! I have 8 years of experience in teaching Arabic language. I have a master\'s degree in literature and the University of Cambridge\'s Certificate in Language Teaching for Young Learners (CELTYL). I enjoy instructing children.'),
(67, 2, '  !   8     .              (CELTYL).    .'),
(68, 1, 'I\'m Zula Koss and I belong to Lesotho and I believe it is critical to aid students in developing real-world connections in the classroom. When you can apply principles outside of the classroom, language learning is most effective. I have demonstrated problem-solving, leadership, and motivational abilities.'),
(68, 2, '                      .             .       .'),
(69, 1, 'Hello All! My name is Francesco Langworth and I\'m working and teaching in multi-cultural teams and situations has given me a unique perspective on the issues that many working professionals confront today. Making my classes participatory and inclusive is something I enjoy doing'),
(69, 2, ' !                         .         '),
(70, 1, 'For the past 7 years, I\'ve worked at the British Council\'s Costa Rica Teaching Centre, where I\'ve taught a variety of course kinds and levels. I\'m highly driven to continue my professional development, I completed a face-to-face course at the British Council on Teaching Young Learners.'),
(70, 2, '                          .                   .'),
(75, 1, 'Hello Students! I\'m Ida Kessler and I work full-time as a language instructor and have taught multiple Chinese, Spanish, Italian languages. I\'ve worked with a variety of organizations, from colleges to corporations, teaching students of various ages. Professional ethics practice standards, and the care and teaching of young children are all important to me.'),
(75, 2, '  !  Ida Kessler             .                   .              .'),
(77, 1, 'I\'m Jon Kunde and I\'ve been teaching English for over 12 years and also have experience teaching a wide range of courses to students across the curriculum, including corporate English, general English, spoken English, IELTS preparation courses, young learner courses, and Teacher Training workshops. I enjoy teaching both in-person and online classes, and I feel that each student is unique.'),
(77, 2, '          12                                 IELTS         .               .'),
(78, 1, 'Hey, Amazing People! I\'m Marge Langworth. Teaching has always been a part of my life, I began tutoring as a high school language teacher. I have taught English language to multiple students. When I\'m not training or preparing for class, I enjoy performing yoga, practicing French, and watching movies.'),
(78, 2, '    !   .              .       .               .'),
(79, 1, 'I\'m Jerod Kohler and I have experience teaching a variety of languages as English, Spanish, Russian, German and speak Afrikaans, Interlingua, Luxembourgish; Letzeburgesch. I enjoy dealing with students and encourage them to express themselves creatively.'),
(79, 2, '                      Letzeburgesch.           .'),
(80, 1, 'I\'m Whitney Gorczany and I love to speak and teach Portuguese, Punjabi, Hebrew-Israel. I\'ve taught a range of courses to both children and young adults, with a focus on business communication skills. Learning, in my opinion, should be enjoyable, and learners should be engaged creatively. To that aim, I make sure that my sessions incorporate games that require my students to concentrate on using the language to attain game goals. My classroom talents include patience and the ability to put students at ease.'),
(80, 2, '          .                   .                .                    .         .'),
(81, 1, 'Hello All! I\'m Antoinette Pfannerstill and I hail from Armenia. I have experience in teaching Portuguese language for about 13 years. In several schools, institutions, and organizations, I\'ve given numerous seminars on language learning. A Portfolio Career was the topic of my latest Ted Talk.'),
(81, 2, '  !      .         13 .              .          Ted Talk.'),
(84, 1, 'My name is Jared Gerhold and my background in the corporate world enables me to recognize the demands of the learner and match them to the course objectives. I teach the language in a communicative manner that encourages learners to not only engage with the language fluently but also to utilize it correctly. I enjoy reading and trying out new dishes in my spare time.'),
(84, 2, '                .                    .        .'),
(85, 1, 'Hello, Students! I\'m Amparo Predovic having 15 years of experience as language instructor. I believe in a learner-centered, communicative approach to teaching with engaging lessons, having trained learners at various levels and taught a variety of courses at multi-national organizations, high commissions, and higher education institutions. My teacher education experience has been in public schools, low-income schools, and well-funded private schools.'),
(85, 2, '  !     15     .                               .                .'),
(86, 1, 'I\'m Claudie Stamm and I have an Academic Management certificate from International House in Kiribati and a Language Awareness certificate from Norwich Institute for Language Education (NILE). I have substantial experience teaching a variety of courses and workshops at both the Teaching Centre and other British Council locations in India.'),
(86, 2, '        International House           ().                       .'),
(87, 1, 'Hello Students! I\'m Donnell Simonis and I have a lot of teaching training expertise, but I really enjoy working with kids. I have taught Hindi in multiple sectors and will help you to learn the same. I have experience instructing in a variety of languages.'),
(87, 2, '  !                  .              .        .'),
(89, 1, 'Hi All! My name is Matt Pollich and I earned an Associate\'s Degree in Liberal Arts and an Associate\'s Degree in Language Teaching from Kennedy King College.  I have my expertise in teaching English, Portuguese, Japanese, Finnish languages. I\'m a self-motivated, results-driven professional with more than ten years of experience in education and community service.'),
(89, 2, '  !                   .         .                    .'),
(90, 1, 'Hi Students! I\'m Tanya Kirlin and I am a Harvard-trained phonetics professional. I have over 20 years of experience assisting customer learners in reaching their full potential. I will help you in learning Hindi language. Assisted in the fields of education, healthcare, information technology, product development, hospitality, consulting, and sports.'),
(90, 2, ' !            .    20             .     .             .'),
(91, 1, 'Hi Students! I\'m Lowell Williamson and I belong to Sweden. I developed my love for teaching in high school, and I particularly enjoy teaching Russian, Japanese, French, German. Teaching online is a fantastic opportunity because I can work around my students\' schedules! Having spent the last few years overseas and majoring in all the languages at the College of William and Mary. I can communicate comfortably in both languages and loves the challenges that language brings!'),
(91, 2, '  !       .                 .            !                 .          !'),
(92, 1, 'Hi everyone! I am Marcel Sauer. I am enthusiastic about teaching students different languages like English, French, Tamil, Hebrew-Israel. I believe in the importance of modern technology and am always looking for new and creative ways to use it in the sessions. I completed my education from Cameroon.'),
(92, 2, ' !   .            .              .    .'),
(94, 1, 'Hello everyone! I am Moriah Schuster and I\'ve worked in language learning and skills service for above 9 years. I speak multiple languages like Bengali, Fijian, Tajik and will also help you all to learn the same. The goal of language learning is to enhance fluency by improving vocabulary and structure. I will make language learning more convenient for you.'),
