(95, 1, 'I\'m a self-starter with a lot of enthusiasm who can work quickly and efficiently. I began teaching languages in 2014 and am continuously learning more about this profile. I make learning enjoyable for students by allowing them to talk freely, make errors, and learn at their own speed and style.'),
(95, 2, '          .      2014       .                .'),
(97, 1, 'I have been living and teaching Chinese in Montenegro from last 9 years. I focus on fluency and breeding confidence, allowing my students to find their own flow and, therefore, improve at their own pace.'),
(97, 2, '         9 .                   .'),
(98, 1, 'Since 2008, I\'ve been living and teaching Hindi, French, Finnish in Hungary. I want all kids to be effective learners, so I aim to establish an exciting, encouraging, and adaptable classroom environment for their various needs. I\'ve also worked as a magazine editor and am the author of two books.'),
(98, 2, '  2008        .                     .       .'),
(99, 1, 'Hello Everyone! I\'m Pinkie Stoltenberg. I\'m a professional Punjabi trainer with over 12 years of teaching experience and about 1736 lessons under my belt. I tailor my instruction to each individual learner, concentrating on their specific needs and laying the groundwork for their language success.'),
(99, 2, '  !   .        12       1736   .                .');
